MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "Calibre RVE provides tree and table views of the results and reports from a Calibre verification run.");
MGCAddSnippet(6, "Calibre RVE (Results Viewing Environment) is a graphical user interface that allows you to view and debug output from Calibre results databases. Calibre RVE is integrated to most standard industry design tools. When Calibre RVE is connected to a supported design tool, you can highlight Calibre results in the layout or schematic; viewing the result in the layout or schematic makes it easier to correct the design error.");
MGCAddSnippet(7, "Calibre Interactive and Calibre RVE are essential components of an interactive workflow using Calibre physical verification tools. Calibre Interactive and Calibre RVE are integrated to most standard industry design tools,");
MGCAddSnippet(8, "Certain requirements for the computing platform, licensing, and environment variables must be met in order to run Calibre RVE. ");
MGCAddSnippet(9, "Calibre RVE can establish connections to most standard industry design tools. This section describes where to find setup and operation information. ");
MGCAddSnippet(10, "The command descriptions use font properties and several metacharacters to document the command syntax. ");
MGCAddSnippet(11, "The Calibre Results Viewing Environment (RVE) is a graphical user interface for viewing and analyzing Calibre results databases. The basic invocation methods and some configuration options and setup procedures are common to all Calibre RVE applications. ");
MGCAddSnippet(12, "Calibre RVE has some common elements for all applications. Invocation methods, some highlighting and view options, search, and text file viewing are common to all applications. ");
MGCAddSnippet(13, "You can start Calibre RVE from a supported design tool, from a Calibre Interactive session, or from the command line. Starting Calibre RVE from a viewer or a Calibre Interactive session connected to a viewer automatically connects Calibre RVE to the viewer. ");
MGCAddSnippet(14, "The session window for all Calibre RVE applications shares the same standard toolbar and some of the same display settings on the Options tab. All applications present multiple reports and databases in a tabbed view, thought the details vary depending on the application. ");
MGCAddSnippet(15, "Highlighting results in a connected layout or schematic viewer is an important part of the physical verification process. Calibre RVE provides many options to simplify the viewing of results from a Calibre run.");
MGCAddSnippet(16, "Several options are available that allow you to control how Calibre RVE handles highlighting events. ");
MGCAddSnippet(17, "Reports and results are organized in report tabs that can be arranged to fit your work flow. In many cases results are presented in a tree view that can be expanded or collapsed. Depending on the application, you can customize the view in the report tabs using the View menu, settings on the Options tab, and right-click menus.");
MGCAddSnippet(18, "The Options tab in Calibre RVE has option categories for the general session view, highlighting, and application-specific views. ");
MGCAddSnippet(19, "Changes you make to Calibre RVE settings are automatically saved when you exit Calibre RVE. The settings are restored the next time you start Calibre RVE. Database-specific options are saved and restored in Calibre RVE for DRC and Calibre RVE for PERC.");
MGCAddSnippet(20, "Text files are opened in a new tab. You can save text files using the File menu, and control the display using the View menu. Some Calibre RVE applications have additional methods for opening specific text files. ");
MGCAddSnippet(21, "You can specify for Calibre RVE to display a link to a custom report. If your Calibre run creates a custom text or HTML-formatted report, you cause Calibre RVE to display a link to the report, allowing you to easily open the report from the Calibre RVE environment. This feature is available in Calibre RVE for DRC, LVS, PERC, and PEX. The implementation depends on which application you are running. ");
MGCAddSnippet(22, "You can run Tcl scripts from the terminal window in Calibre RVE. Tcl scripts in Calibre RVE for DFM can include YieldServer commands. ");
MGCAddSnippet(23, "The Macros menu is a special menu that allows you to run Tcl/Tk procedures directly from Calibre RVE; in Calibre RVE for DFM you can also run YieldServer commands. This menu is created when a Calibre RVE macro configuration file with the rve::addmenu command is present.");
MGCAddSnippet(24, "The Macros menu is created when a Calibre RVE macro configuration file is present. The Macros menu is a special menu that allows you to run Tcl/Tk procedures directly from Calibre RVE; in Calibre RVE for DFM you can also run YieldServer commands.");
MGCAddSnippet(25, "The Calibre RVE macro configuration file is used to add an item to the Macros menu in Calibre RVE. The new menu item calls a user-defined Tcl procedure.");
MGCAddSnippet(26, "The rve::addmenu command adds items to the Macros menu in Calibre RVE. ");
MGCAddSnippet(27, "The Search Toolbar is used to search for text strings in the selected text or results tab. A dropdown list allows the choice of matching case or searching using regular expressions. When regular expressions are enabled, the search does not start until you press Enter on the keyboard.");
MGCAddSnippet(28, "Calibre RVE handles case sensitivity differently depending on the application and the task being performed. ");
MGCAddSnippet(29, "There are three options for setting up the timeout of your Calibre RVE license. ");
MGCAddSnippet(30, "It is very useful to have your Calibre RVE session connected to a layout viewer so that you can highlight results, and cross-probe results between the geometric layout and the source. ");
MGCAddSnippet(31, "Automatic connection between Calibre RVE and a viewer is made when you start Calibre RVE from the viewer.");
MGCAddSnippet(32, "Although automatic connection between Calibre RVE and a viewer is usually more convenient, you can also manually set the socket number and start the socket connection. When using Calibre RVE for DRC, you can connect to two layout design tools. ");
MGCAddSnippet(33, "Calibre RVE can be started in several ways, depending on your usage. ");
MGCAddSnippet(34, "Invoking Calibre RVE from a layout or schematic viewer automatically creates a connection between Calibre RVE and the viewer. ");
MGCAddSnippet(35, "You can instruct Calibre Interactive to start Calibre RVE automatically after the Calibre run finishes. Calibre RVE automatically opens the results database specified on the Outputs pane. If Calibre Interactive is connected to a supported design tool, Calibre RVE is automatically connected to the design tool.");
MGCAddSnippet(36, "You can open Calibre RVE manually from Calibre Interactive with the Start RVE button. Calibre RVE attempts to open the results database specified on the Outputs pane. If Calibre Interactive is connected to a supported design tool, Calibre RVE is automatically connected to the design tool.");
MGCAddSnippet(37, "You can invoke Calibre RVE from the command line.");
MGCAddSnippet(38, "By default, the working directory for Calibre RVE is set to the directory Calibre RVE was called from. You can set the Calibre RVE working directory with the environment variable MGC_CALIBRE_DB_DIR. When MGC_CALIBRE_DB_DIR is set, the Calibre RVE file browser defaults to the directory set with MGC_CALIBRE_DB_DIR, not the directory Calibre RVE was called from. ");
MGCAddSnippet(39, "Calibre RVE runs on the local host by default. You can also specify that Calibre RVE run on a remote host or computer cluster. ");
MGCAddSnippet(40, "Multithreaded parallel processing is supported for some operations performed in Calibre RVE, such as Interactive Short Isolation in Calibre RVE for LVS and DRC operations executed from a YieldServer script or the Layer Browser tab in Calibre RVE for DFM. ");
MGCAddSnippet(41, "The standard toolbar and the certain menu selections and option panes are common to all Calibre RVE applications. ");
MGCAddSnippet(42, "This section describes the menu selections that are common to all Calibre RVE applications.");
MGCAddSnippet(43, "The File menu has some selections that are common to all Calibre RVE applications. ");
MGCAddSnippet(44, "The Highlight menu has several highlighting selections that are common to all Calibre RVE applications.");
MGCAddSnippet(45, "The Window menu has several selections that are common to all Calibre RVE applications. ");
MGCAddSnippet(46, "The Standard Toolbar is shown is common to all Calibre RVE applications.");
MGCAddSnippet(47, "The Connection icon displays the connection status and includes a dropdown menu to connect, disconnect, and open the Options tab. ");
MGCAddSnippet(48, "You can control various display and highlight settings for Calibre RVE on the option panes. This section describes the option panes that are common across multiple Calibre RVE applications. ");
MGCAddSnippet(49, "The Options tab displays option settings for Calibre RVE. Individual option panes are selected from a list of categories on the left panel. ");
MGCAddSnippet(50, "Use this pane to make session settings common to all Calibre RVE applications.");
MGCAddSnippet(51, "Use this pane to select highlighting options that are common to all Calibre RVE applications.");
MGCAddSnippet(52, "Use this pane to control options for connecting to a layout or schematic viewer.");
MGCAddSnippet(53, "Use this pane to set filters for the database name and the unzip directory when you use a compressed database. Trigger functions that execute on certain database actions are also set on the Databases pane, along with options related to loading databases.");
MGCAddSnippet(54, "Use this pane to make settings for histograms and colormaps in Calibre RVE for DRC and DFM.");
MGCAddSnippet(55, "This option pane controls settings for waiver display, waiver export, and trigger functions tied to waiver export.");
MGCAddSnippet(56, "The Calibre Quality Agent dialog box is displayed when Calibre RVE encounters an application error. ");
MGCAddSnippet(57, "Calibre RVE (Results Viewing Environment) is a graphical user interface used to view Calibre results databases. Calibre DRC, LVS, DFM, PERC, and PEX databases are supported. The Calibre RVE Spice File Viewer displays SPICE netlists and a rendered schematic. ");
MGCAddSnippet(58, "Command line invocation for Calibre RVE (Results Viewing Environment).");
MGCAddSnippet(59, "Calibre RVE option settings are saved in a configuration file named .rvedb. The configuration file is saved automatically in your home directory by default; however, you may specify a different location for the configuration file. Database-specific options are saved in Calibre RVE for DRC and Calibre RVE for PERC; these options are saved automatically in the .rve directory in your home directory and restored when you reopen the database. ");
MGCAddSnippet(60, "Calibre RVE options are saved to the .rvedb file located in your home directory by default. This file is accessed every time you invoke Calibre RVE. To return a setting to its default, you must specify the default explicitly. If you delete the .rvedb file, all settings return to their default values.");
MGCAddSnippet(61, "You can define multiple locations for the .rvedb configuration file with the MGC_RVEDB_DIR environment variable. This allows you to apply both global and project level settings, for example, and define the order of precedence for applying options. ");
MGCAddSnippet(62, "You can create a .rvedb configuration file to open Calibre RVE with specific option settings. The location of the .rvedb file is specified with the MGC_RVEDB_DIR environment variable. For example, you can create a .rvedb file with settings for layout magnification and rotation and use that configuration file for projects that require these settings. Another possibility is option settings for waiver export from Calibre RVE for Calibre Auto-Waivers. ");
MGCAddSnippet(63, "In Calibre RVE for DRC and Calibre RVE for PERC, some options, such as the  Group By  hierarchy and result filters, are associated with a specific results database and restored when you open that database again. ");
MGCAddSnippet(64, "Calibre RVE requires the certain database files depending on the Calibre RVE application.");
MGCAddSnippet(65, "Calibre RVE for DRC displays results in a tree view and includes options for sorting and filtering the results. You can highlight results in a connected layout viewer and mark results as fixed or waived. ");
MGCAddSnippet(66, "The session window is designed to help you analyze the results from a Calibre nmDRC run. It allows you to view, sort, analyze, and track DRC results throughout your verification process. ");
MGCAddSnippet(67, "There are times when you want to mark a particular result as waived. A waived result is a DRC violation that is considered acceptable for the design and process. Waiver information is typically available from the foundry. Waiving results allows you to acknowledge the existence of acceptable errors in your design, therefore making your DRC debugging sessions more efficient.");
MGCAddSnippet(68, "Some common tasks in Calibre RVE for DRC are highlighting, grouping, filtering, and waiving results. ");
MGCAddSnippet(69, "This section summarizes the controls for highlighting, marking, sorting, grouping, and filtering results. ");
MGCAddSnippet(70, "You can set various options that control how results are highlighted and highlight the result using several methods. You can highlight clusters (groups of results) from the tree view. ");
MGCAddSnippet(71, "Calibre RVE for DRC can highlight to two layout design tools, enabling you to debug in one design tool and edit the layout in a different tool. For example, you can debug the DRC results in Calibre DESIGNrev and make the required fix in your place and route tool. ");
MGCAddSnippet(72, "As you fix or waive results you can mark them in the database. Sorting and grouping features make it easier for you to select which results you want to display. ");
MGCAddSnippet(73, "Different icons are used to indicate the result status in Calibre RVE for DRC.");
MGCAddSnippet(74, "You can mark a result as waived using Calibre RVE for DRC. You can also enable options to include a waiver comment with the result and to execute trigger functions before and after the waiver export. ");
MGCAddSnippet(75, "To mark a result or cluster as fixed, right-click the selection, and choose Fix > Fix. You can also use the F keyboard keys to mark results as fixed.");
MGCAddSnippet(76, "You can select the columns that are displayed in the tree or details view in Calibre RVE for DRC. ");
MGCAddSnippet(77, "You can group results in the tree view by cell name, check name, property name, or property value. Use the View > Tree Options > Group By menu selection or right-click in the first column header to select the grouping method. ");
MGCAddSnippet(78, "If you are working in a particular region of the layout, you can fix, waive, and select results in that region. ");
MGCAddSnippet(79, "DRC results filters allow you to select a subset of your DRC results to display in Calibre RVE. System-defined filters are available, or you can create and save a custom filter. You can also use the command line to filter results and save them in new results databases. See the following sections:");
MGCAddSnippet(80, "DRC results filters are selected from a list of system-defined and user-defined result filters.");
MGCAddSnippet(81, "Custom DRC result filters allow you to specify multiple conditions for a filter, such as check name, property value, waived state, and other conditions. Custom filters are saved and included in the dropdown list of filters.");
MGCAddSnippet(82, "You can filter DRC results by user-defined categories. Filtering by categories makes it easier to select only the checks you are interested in debugging—only checks in the selected categories are displayed in the tree view of the Calibre RVE. A category is a grouping of rule checks and is defined in the Check Text Override (CTO) file. ");
MGCAddSnippet(83, "Command line invocation for filtering results in Calibre RVE in batch mode.  You can filter results based on their properties, waived states, locations in their cells, and other criteria, then save them to new results databases. Full usage is given by calibre -rve -filter -help.");
MGCAddSnippet(84, "If you have waived results in your database, you can use Calibre RVE for DRC to create the waiver geometry file needed for Calibre Auto-Waivers. ");
MGCAddSnippet(85, "Results from cloned cells are displayed in Calibre RVE with the #Flipped and #Rotated properties in the Details format of the Result View. ");
MGCAddSnippet(86, "You can highlight results from cloned cells in the context of the original cell or in the top cell. You can also highlight to a layout generated by Calibre with cloned cells. ");
MGCAddSnippet(87, "Results from cloned cells are waived in the original cell, Any result from a cloned cell which matches a waived result in the original cell is also waived when you reload the results database.");
MGCAddSnippet(88, "The Calibre RVE Highlight > Highlight in Context menu item specifies that results are highlighted in the cell in which they are reported, rather than in the top cell. This feature depends on results being reported by cell in your DRC results database, which is enabled with the DRC Cell Name specification statement. This option is only available for hierarchical Calibre nmDRC.");
MGCAddSnippet(89, "Depending on your layout viewer, there may be some special highlighting methods or considerations to take into account. ");
MGCAddSnippet(90, "The commands Net Area Ratio, Density, Layout Input Exception RDB, and several DFM operations can cause Calibre nmDRC to save an auxiliary results database (RDB). These auxiliary databases, or side RDBs, can be viewed in Calibre RVE for DRC. ");
MGCAddSnippet(91, "DRC ASCII results databases can contain properties attached to geometric results. Such properties are typically created by Density and DFM operations. The database properties are shown by default in the Details format and Results Data views of the report tab. You can also instruct Calibre RVE to display database properties when highlighting results and create a histogram or colormap. ");
MGCAddSnippet(92, "You can create an HTML formatted report of the results that are displayed in Calibre RVE for DRC or save the results data to a CSV (comma-separated value) formatted file. HTML reports make it easy to share results between groups. A CSV formatted file can be imported into most spreadsheet tools for later analysis.");
MGCAddSnippet(93, "You can automatically create a DRC RVE HTML report based on the view open in Calibre RVE for DRC. ");
MGCAddSnippet(94, "Calibre RVE for DRC can save results data to a CSV (comma-separated value) formatted file. The CSV file can then be imported into most spreadsheet tools for later analysis.");
MGCAddSnippet(95, "You can save a Calibre nmDRC results database in CSV (comma-separated value) format from the command line, without displaying the Calibre RVE for DRC interface. ");
MGCAddSnippet(96, "You can save selected results from a Calibre nmDRC results database as a new RDB. You can use a filter to select the results that are saved or use Ctrl- and Shift-click to select the results. The new RDB can be used to share results or as input to DRC HTML reporting. ");
MGCAddSnippet(97, "Histograms and colormaps are useful ways to view the distribution of property values for DRC results. Histograms can only be created for numeric properties. Colormaps can be created for properties with numeric, string, or mixed numeric and string values.");
MGCAddSnippet(98, "You can use Calibre RVE for DRC to view RDB output and properties from the Net Area Ratio (NAR) SVRF statement. ");
MGCAddSnippet(99, "Calibre RVE can display the contents of the files output by the Net Area Ratio Print operation and the PRINT keyword of the Density operation and highlight the location of the violations. The Net Area Ratio Print operation saves the output of a Net Area Ratio ACCUMULATE operation, which is often used to check for antenna violations. ");
MGCAddSnippet(100, "The main session window, report tabs, and toolbars are described here. This section also describes the application-specific menu selections and option panes.");
MGCAddSnippet(101, "The session window in Calibre RVE for DRC displays a tree view of results with windows for detailed result viewing. ");
MGCAddSnippet(102, "This section describes the DRC-specific menu selections. ");
MGCAddSnippet(103, "The File menu in Calibre RVE for DRC has selections for saving the database or a subset of it and for viewing side or auxiliary RDBs.");
MGCAddSnippet(104, "The View menu in Calibre RVE for DRC has selections for viewing reports and setting options for the tree and result views.");
MGCAddSnippet(105, "The Highlight menu in Calibre RVE for DRC has selections for highlighting in the top cell or the context of the result and for assigning the layers used for highlighting.");
MGCAddSnippet(106, "The Tools menu in Calibre RVE for DRC has selections related to waivers and Check Text Override (CTO) files.");
MGCAddSnippet(107, "The following toolbars and control bars are available in Calibre RVE for DRC:");
MGCAddSnippet(108, "The Highlight toolbar contains buttons for highlighting results and for the Highlight in Context setting. ");
MGCAddSnippet(109, "The Histogram and Colormap Toolbar provides a quick way to select a property and create the histogram or colormap.");
MGCAddSnippet(110, "The Restore Default Layers button toggles the layer visibility in supported design tools. ");
MGCAddSnippet(111, "The Search Toolbar searches for the specified text in cell names, check names, check text, and text tabs. ");
MGCAddSnippet(112, "The Tools > Export to Layout menu selection opens a toolbar that allows you to export results on a cell-by-cell basis to the layout editor. ");
MGCAddSnippet(113, "DRC result filters apply filtering criteria to the DRC results database so that a subset of results are displayed. ");
MGCAddSnippet(114, "Assigns the layers or layer colors that are used in the layout viewer for highlight operations. ");
MGCAddSnippet(115, "The results from a Calibre nmDRC run are displayed in a report tab labeled by the database name. The tab has a Tree View and a Result View that lists individual results. Each view has display options that are discussed in their respective reference sections.");
MGCAddSnippet(116, "Calibre RVE for DRC uses certain conventions to mark results as clean, fixed, or waived. ");
MGCAddSnippet(117, "Several keyboard shortcuts are defined for navigation and result selection in the tree and result views of Calibre RVE for DRC. ");
MGCAddSnippet(118, "The tree view in Calibre RVE for DRC displays results grouped by check name, cell name, property name, or property value, depending on the selection from the View > Tree Options > Group By menu. Custom groupings can be defined. The View > Tree Options menu also controls the display of empty checks. ");
MGCAddSnippet(119, "You can group results in the tree view by check and cell name using the View > Tree Options > Group By selection or the Group By button.");
MGCAddSnippet(120, "The property tree displays the results grouped by property and gives statistics on each property. Select View > Tree Options > Group By > Statistics … for this view. ");
MGCAddSnippet(121, "You can select a custom grouping hierarchy with the View > Tree Options > Group By > Custom menu selection. This allows you to group by property value, check, and cell in any hierarchical order. ");
MGCAddSnippet(122, "The Result View lists each of the results selected in the Tree View. Select the format of the Result View from the View > Result Options menu, You can choose List, Icon, or Details view, where the Details view presents the result in a table format. ");
MGCAddSnippet(123, "You can get a context sensitive menu by right-clicking a check name, result cluster, or individual result in the result view.");
MGCAddSnippet(124, "Bookmarks save the view options for the result tab so that you can easily return to a previous view for a debug session. A bookmark saves information such as the applied result filter, the Group By setting, the column selections, and more. ");
MGCAddSnippet(125, "The Bookmarks menu has selections to save a new bookmark and open a bookmarked view in Calibre RVE for DRC. Bookmarks save the view options for the result tab so that you can easily return to a previous view for a debug session. A bookmark saves information such as the applied result filter, the Group By setting, the column selections, and more. ");
MGCAddSnippet(126, "You use the Bookmarks menu to create and delete user bookmarks and change the bookmark name. Bookmarks save the view options for the result tab so that you can easily return to a previous view for a debug session. A bookmark saves information such as the applied result filter, the Group By setting, the column selections, and more.");
MGCAddSnippet(127, "Admin bookmarks are permanent bookmarks associated with the results database. The topics in this section explain the use of admin bookmarks. ");
MGCAddSnippet(128, "You choose Export Bookmarks in the Bookmarks menu to create an admin bookmark file. If you already have an admin bookmark file, you can use this procedure to add new admin bookmarks to the admin bookmark file. Admin bookmarks are permanent bookmarks associated with the results database. ");
MGCAddSnippet(129, "You can specify the admin bookmark file either automatically by following a naming convention or with an environment variable. Admin bookmarks are permanent bookmarks associated with the results database. ");
MGCAddSnippet(130, "Histograms and colormaps make it easier to analyze properties that are attached to geometric results in the DRC results database. Properties are typically generated by Density and DFM operations. ");
MGCAddSnippet(131, "The histogram window displays a bar chart showing the frequency distribution of a selected property value. You can adjust the x-axis endpoints and binning, the color scheme, and other display options. ");
MGCAddSnippet(132, "This dialog box is used to export waiver shapes for use with Calibre Auto-Waivers. ");
MGCAddSnippet(133, "The Option panes provide settings for Calibre RVE for DRC.");
MGCAddSnippet(134, "This option pane controls settings for the DRC Browser in Calibre RVE. ");
MGCAddSnippet(135, "The DRC/DFM Highlighting area of the Setup Highlighting Options pane controls highlighting options for Calibre RVE for DRC and Calibre RVE for DFM. ");
MGCAddSnippet(136, "You can use rule check comments to provide additional control over the Calibre RVE display and highlighting actions. The rule check comments are placed in your DRC Results database or a check text override (CTO) file and interpreted by Calibre RVE for DRC. ");
MGCAddSnippet(137, "There are two ways to add DRC RVE rule check comments: in the rule file or in a Check Text Override File (CTO File). ");
MGCAddSnippet(138, "You can add DRC RVE rule check comments to the rule check definition in your rule file. ");
MGCAddSnippet(139, "You can specify DRC RVE rule check comments in a CTO file. This method allows you to specify rule check comments for a Calibre nmDRC results database without editing the rule file or running Calibre nmDRC again. ");
MGCAddSnippet(140, "A Calibre nmDRC results database can have rule check comments from two sources: the rule file and the Check Text Override file (CTO file). Settings in the DRC RVE check text override file take precedence over settings found in the DRC results database as a result of rule check comments in the rule file, except in the case of the RVE Link statement. By default, RVE Link statements in the check text override file are merged with those found in the results database; merging can be turned off by disabling the option  Append RVE LINK statements to existing check text  on the Calibre RVE Options tab in the DRC Browser category.");
MGCAddSnippet(141, "DRC RVE rule check comments provide additional control over the Calibre RVE display and highlighting actions. The rule check comments are placed in your DRC Results database or a check text override (CTO) file and interpreted by Calibre RVE for DRC.");
MGCAddSnippet(142, "A DRC RVE rule check comment which specifies the highlight layer index used for the rule check. ");
MGCAddSnippet(143, "A DRC RVE rule check comment which specifies the highlight layer color used for the rule check in supported layout viewers. ");
MGCAddSnippet(144, "A DRC RVE rule check comment which specifies the text size for text objects added during highlight operations. ");
MGCAddSnippet(145, "A DRC RVE rule check comment which creates a hyperlink that is displayed in the check text pane of Calibre RVE for the rule check. ");
MGCAddSnippet(146, "A DRC RVE rule check comment which sets the display priority for a rule check. The rule check priority is displayed in the tree view of Calibre RVE for DRC and can be used to sort and filter the rule checks.");
MGCAddSnippet(147, "A DRC RVE rule check comment that specifies the layers that are shown in the layout editor when highlighting a result from the rule check. ");
MGCAddSnippet(148, "A DRC RVE rule check comment which specifies the properties to display during a highlight operation.");
MGCAddSnippet(149, "A DRC RVE rule check comment which can toggle a rule check as waivable or not, and also prevent this setting from being overwritten. This comment can be applied to a single rule check, a group of rule checks, or a mix of rule checks in a group.");
MGCAddSnippet(150, "A DRC RVE rule check comment which creates a link to the specified side RDB in the check text pane of Calibre RVE for DRC. This rule check comment can only be placed within a rule check in the SVRF rule file.");
MGCAddSnippet(151, "The DRC RVE check text override file (CTO file) allows you to specify DRC RVE rule check comments for a DRC results database and load the settings into a Calibre RVE for DRC session. DRC RVE rule check comments allow you to specify highlight colors, display layers, document links, and other settings related to highlighting results. The CTO file also defines categories for filtering by category. When you use a CTO file you can use DRC rule check comments without editing the rule file or running Calibre again. ");
MGCAddSnippet(152, "The DRC RVE check text override file (CTO file) allows you to specify DRC RVE rule check comments for a DRC results database and load the settings into a Calibre RVE for DRC session. DRC RVE rule check comments allow you to specify highlight colors, display layers, document links, and other settings related to highlighting results. The CTO file also defines categories for filtering by category. ");
MGCAddSnippet(153, "There are several methods to create a CTO file from the rule file. You can use Calibre Interactive nmDRC, Calibre RVE for DRC, or the Calibre RVE command line. The available options differ for the different methods. ");
MGCAddSnippet(154, "Select Tools > Create CTO File to have Calibre RVE create a CTO file to control layer visibility for highlight actions. The CTO file is used by Calibre RVE for DRC and DRC HTML reporting. The automatically generated CTO file causes only the layers used in the rule check to be displayed when highlighting a result. ");
MGCAddSnippet(155, "Calibre Interactive—nmDRC can create a Check Text Override file to control layer visibility for highlight actions and to define categories for filtering by category. The CTO file is used by Calibre RVE for DRC and DRC HTML reporting. The automatically generated CTO file causes only the layers used in the rule check to be displayed when highlighting a result. Category definitions are optional.");
MGCAddSnippet(156, "When creating a CTO file using Calibre RVE or Calibre Interactive, you can specify a layer map file if you want the RVE Show Layers statements in the CTO file to use layer and purpose pairs or layer names rather than layer numbers. You can use a Calibre DESIGNrev layerprops file or a third-party layer map file. Some restrictions apply when using a layer map file. This topic includes examples of CTO files created with and without a layer map file. ");
MGCAddSnippet(157, "The DRC RVE Check Text Override File (CTO File) is used to configure a Calibre RVE for DRC session with DRC RVE rule check comments. DRC RVE rule check comments allow you to specify highlight colors, display layers, document links, and other settings. You can load the CTO file using an environment variable, automatically based on file naming, or with the Tools > Import CTO File menu selection. ");
MGCAddSnippet(158, "When you start Calibre RVE from a Calibre Interactive nmDRC session, most of the methods for loading a Check Text Override file (CTO file) are the same as when you start Calibre RVE from a design tool or from the command line. ");
MGCAddSnippet(159, "This chapter describes how to create HTML formatted reports of Calibre DRC results. You can create HTML pages corresponding to views in Calibre RVE for DRC for any ASCII format DRC results database (RDB). You can specify views of result tables, tree views, result highlights, histograms, and colormaps. Controls are included for grouping, filtering, and sorting the results, and for customizing the report format. ");
MGCAddSnippet(160, "DRC HTML Reporting requires a Calibre nmDRC results database and a configuration file. Other optional input files are required depending on report options and customization. ");
MGCAddSnippet(161, "The following examples create a basic DRC HTML report then explain how to add additional report sections and features. ");
MGCAddSnippet(162, "An example of a basic DRC HTML report that can be run on any database is provided. ");
MGCAddSnippet(163, "You can process multiple DRC results databases (RDBs) with the same DRC HTML report configuration file.");
MGCAddSnippet(164, "DRC HTML Reporting can automatically open and process the side RDBs created with the main results database. You can specify which side RDBs are opened and specify what types of RDBs are processed by each report section in the configuration file. ");
MGCAddSnippet(165, "You can add highlight images to the DRC HTML report using a DRCResults or DRCHighlight report section.");
MGCAddSnippet(166, "You can apply filters to select the results that are included in each section of the HTML Report. You can filter by check or cell name, waived and fixed state, and area, for example.");
MGCAddSnippet(167, "You can specify which design layers are displayed when a result highlight is shown in the DRC HTML Report. This is done using a DRC RVE Check Text Override File (CTO file) with RVE Show Layers check text comments to specify the layer visibility. You can create the CTO file automatically or create a custom CTO file. You can also use the key HideNonHLLayers to hide all design layers and only show highlight layers; this is useful for overview snapshots. ");
MGCAddSnippet(168, "You specify highlight colors with the CheckHLLayer key. By default the DRC HTML report uses a the DRC RVE Check Text Override file (CTO file), if present, or check text comments in the results database. If not using a CTO file or check text comments, you can highlight with a different color for each check or use a single color for all checks. ");
MGCAddSnippet(169, "You use the SortBy key to sort the results in your DRC HTML report. Sorting can be by the available columns or by a property value. You can use the Priority value (set with the RVE Priority check text comment) to specify a custom sort order for rule checks. ");
MGCAddSnippet(170, "You can use the Calibre DESIGNrev layerprops and preferences files to control the layout display in result highlight images created by DRC HTML reporting. There are several methods for using these files. ");
MGCAddSnippet(171, "The layout images used in DRC HTML reporting are created by Calibre DESIGNrev or Calibre MDPview, both of which use a preferences file to control display options. A preferences file that is optimized for creating DRC HTML reports is used by default. You can also specify your own preferences file, and specify to use settings optimized for faster processing.");
MGCAddSnippet(172, "You can create a DRC HTML Report from Calibre RVE for DRC without the need to create a configuration file. A shell script is created so that you can run the report at a later time from the command line. ");
MGCAddSnippet(173, "You can create an HTML formatted report of the results that are displayed in Calibre RVE for DRC. The report generation is completely automatic and is based on the current view in Calibre RVE for DRC. Results highlights can be included if the layout is available in GDS, OASIS, or one of the formats supported by Calibre MDPview. Choose Tools > Create HTML Report to start the report creation. A shell script is created so that you can run the report at a later time from the command line. ");
MGCAddSnippet(174, "You can create a DRC HTML report from the shell. Use the  calibre -rve  command with appropriate options. ");
MGCAddSnippet(175, "The database map file specifies one or more DRC database files as input for DRC HTML reporting. If result highlight images are included in the DRC HTML report, the layout database file and an optional Calibre DESIGNrev layout properties (layerprops) file are also specified in the file. ");
MGCAddSnippet(176, "The configuration file controls how the DRC HTML report is generated. ");
MGCAddSnippet(177, "The DRC report configuration file contains various parameters that control how the DRC HTML report is generated. ");
MGCAddSnippet(178, "In DRC HTML reporting, you can inherit settings from another report section. ");
MGCAddSnippet(179, "This section defines the key values available for the DRC HTML report configuration file. ");
MGCAddSnippet(180, "The summary table lists the available key values for the DRC HTML report configuration file.");
MGCAddSnippet(181, "Include only the specified cell(s). AND logic is used if multiple cells are specified with a comma-separated list of values. ");
MGCAddSnippet(182, "Include only the specified check(s). AND logic is used if multiple checks are specified with a comma-separated list of values. ");
MGCAddSnippet(183, "Include only results that meet the specified property expression. AND logic is used if multiple property expressions are specified with a comma-separated list.");
MGCAddSnippet(184, "Specifies a list of RDB types that the report section applies to.");
MGCAddSnippet(185, "Include only results that are within (or not in) the specified region.");
MGCAddSnippet(186, "Specifies whether to calculate and show the calculated properties #PP, #PA, #EL, #EC, and #EW. ");
MGCAddSnippet(187, "Specifies the highlight layer and color. The available options are to use the CTO file or check text, to use a different highlight layer for each rule check, or to use a single highlight color for all rule checks. ");
MGCAddSnippet(188, "Specifies whether to calculate and show the shape class (#SC) property. ");
MGCAddSnippet(189, "Specifies a pre-defined color palette to use for histograms and colormaps.");
MGCAddSnippet(190, "Specifies whether to automatically create a DRC RVE Check Text Override File (CTO) file with RVE Show Layers statements based on the rule check definitions in the rule file. ");
MGCAddSnippet(191, "Path to a custom CSS file used to format the DRC HTML report. ");
MGCAddSnippet(192, "Specifies a custom color palette to use for histograms and colormaps when ColorSet=custom.");
MGCAddSnippet(193, "Full path to an HTML customization file. This file contains HTML div tags with predefined id s.");
MGCAddSnippet(194, "Specifies a displacement in the X direction for highlighted shapes. The key DisplaceHighlightsInAllCells determines whether highlights are displaced in the top cell only (default) or in all cells.");
MGCAddSnippet(195, "Specifies a displacement in the Y direction for highlighted shapes. The key DisplaceHighlightsInAllCells determines whether highlights are displaced in the top cell only (default) or in all cells.");
MGCAddSnippet(196, "Specifies whether shapes are displaced in the top cell only (default) or all cells when DisplaceHighlightsByX or DisplaceHighlightsByY is specified.");
MGCAddSnippet(197, "Specifies the directory for a Calibre DESIGNrev preferences file.");
MGCAddSnippet(198, "Specifies the name of a section with ReportType = DRCFilter. When this keyword is used, filter settings in the referenced section are used; filter settings in the current section are ignored.");
MGCAddSnippet(199, "Include only results with the specified fixed state.");
MGCAddSnippet(200, "In the DRCResultsSummary report, GroupBy specifies the grouping hierarchy for the report. In all other reports, one report is output for each GroupBy criteria. ");
MGCAddSnippet(201, "Specifies whether to hide all layers other than highlight layers. This option is useful in top-level overview snapshots, where hiding the design layers provides a better view of the highlights.");
MGCAddSnippet(202, "Specifies whether the DRCResults report will include an image of the result highlighted in the corresponding layout file. The zoom factor is determined by the ZoomLayoutFactor and the image is sized according the values of LayoutWidth and LayoutHeight.");
MGCAddSnippet(203, "Specifies whether results are highlighted in the top cell or in the cell they are reported in.");
MGCAddSnippet(204, "Specifies the order in which colors are used for histograms and colormaps.");
MGCAddSnippet(205, "The height of the layout image in pixels.");
MGCAddSnippet(206, "The width of the layout image in pixels.");
MGCAddSnippet(207, "Specifies whether the file specified by CssFilePath is copied to the report directory. The file is not copied by default. ");
MGCAddSnippet(208, "Specifies to place hyperlinks between the current report and the DRCResultsSummary report referenced by the LinkFrom key. Use of LinkFrom enables you to have links between the report sections without inheriting report settings from the DRCResultsSummary section though use of the GroupBy key; in particular it is possible to have different filter settings in the two sections and still have links between the reports. ");
MGCAddSnippet(209, "Specifies whether the rule file is copied to the output directory (default) for linking or linked to in its original location. ");
MGCAddSnippet(210, "Specifies whether a logarithmic Y-axis is used for histograms.");
MGCAddSnippet(211, "Specifies a magnification factor for highlighted shapes. If specified, all result coordinates are magnified by the given factor.");
MGCAddSnippet(212, "A group of key values that specifies whether to open and process any side (auxiliary) RDBs of the given type which are included in the main RDB. The default value varies by the RDB type. ");
MGCAddSnippet(213, "Include only the specified cell(s). OR logic is used if multiple cells are specified with a comma-separated list of values. ");
MGCAddSnippet(214, "Include only the specified check(s). OR logic is used if multiple checks are specified with a comma-separated list of values. ");
MGCAddSnippet(215, "Include only results that meet the specified property expression. OR logic is used if multiple property expressions are specified with a comma-separated list. ");
MGCAddSnippet(216, "Specifies the format of the report. The default output format is HTML.");
MGCAddSnippet(217, "Specifies to adjust the Calibre DESIGNrev settings such that the layer browser (or palette) image is the same for all highlight results for the same rule check. This typically results in faster processing, especially for reports with many highlight images.");
MGCAddSnippet(218, "Specifies the bin divisions for a histogram or colormap with PropRangeDistributionType=custom.");
MGCAddSnippet(219, "Comma-separated list of property names to use for DRCHistogram and DRCColormap reports. All properties are included by default (Property=*). ");
MGCAddSnippet(220, "Include only results that meet the specified property expression. AND logic is used if multiple property expressions are specified with a comma-separated list.");
MGCAddSnippet(221, "Specifies the number of bin divisions for a histogram or colormap when PropRangeDistributionType=Linear.");
MGCAddSnippet(222, "Specifies the distribution range for a histogram or colormap when PropRangeDistributionType=Linear.");
MGCAddSnippet(223, "Specifies the type of distribution for a histogram or colormap.");
MGCAddSnippet(224, "Specifies whether to reflect highlight shapes along the X axis. ");
MGCAddSnippet(225, "Specifies the type of report to generate, except for ReportType of DRCFilter. Filter settings apply to all report types.");
MGCAddSnippet(226, "Specifies a rotation angle for highlighted shapes. If specified, highlighted shapes are rotated counterclockwise about the origin by the given value. ");
MGCAddSnippet(227, "Specifies whether shapes are rotated in the top cell only (default) or all cells when RotateHighlightsBy is specified.");
MGCAddSnippet(228, "Specifies the orientation for X-axis labels of a histogram.");
MGCAddSnippet(229, "Specifies the number of rows to include for each leaf in the GroupBy hierarchy.");
MGCAddSnippet(230, "A group of key values that specifies whether to show side (auxiliary) RDBs of the given type as checks in the tree view. The default setting depends on the database type. ");
MGCAddSnippet(231, "Specifies whether or not to include check text in the report. In the DRCResultsSummary report, the check text is displayed if Check is in the GroupBy hierarchy.");
MGCAddSnippet(232, "Specifies which columns to show in the DRCResults and DRCResultsSummary report sections. ");
MGCAddSnippet(233, "Specifies whether or not to include empty checks in the DRCResultsSummary report.");
MGCAddSnippet(234, "Specifies whether to highlight all instances of a hierarchical result in the top cell, that is, to flatten the results to the top level. The key HighlightInContext must also be enabled in order to enable this option. ");
MGCAddSnippet(235, "Specifies whether or not to include added graphics, such as the frame and rulers, to layout snapshot images like color maps.");
MGCAddSnippet(236, "Specifies whether to display the results highlight markers in the layout image. ");
MGCAddSnippet(237, "Sort the results by the specified column. Sorting is done within each leaf in the GroupBy hierarchy.");
MGCAddSnippet(238, "Determines sort order when used with SortBy.");
MGCAddSnippet(239, "Specifies whether the DRC HTML report creation date in the report header is given in Greenwich Mean Time (GMT) or the local timezone. The default is GMT. ");
MGCAddSnippet(240, "Specifies whether to use HTML frames to display the report. ");
MGCAddSnippet(241, "Include only results waived by the specified user. ");
MGCAddSnippet(242, "Include only results in which the comment matches the specified filter value. A comma-separated list of comments is allowed. The ! character indicates negation. The wildcard character * is allowed.");
MGCAddSnippet(243, "Include only results which match the specified date constraint.");
MGCAddSnippet(244, "Include only results with the specified waived state.");
MGCAddSnippet(245, "Specifies whether to include an image of the Calibre DESIGNrev World View along with the layout image.");
MGCAddSnippet(246, "Specifies a space-separated list of numbers defining absolute coordinates in pixels for an image window.");
MGCAddSnippet(247, "Specifies a comma-separated list of zoom options to use when including layout images for DRCResults, DRCHighlight, and DRCColormap reports. One image is included for each specified option.");
MGCAddSnippet(248, "Specifies whether ZoomLayoutFactor is a ratio or in user units.");
MGCAddSnippet(249, "You can specify the output format of the DRC HTML report and customize the report format. ");
MGCAddSnippet(250, "You can specify the format of the report as standard HTML (the default) or single file MHTML with the OutputFormat key. ");
MGCAddSnippet(251, "You can specify a custom Cascading Style Sheet (CSS) file for the DRC HTML report. The CssFilePath key name specifies the path to the custom CSS file. ");
MGCAddSnippet(252, "The HTML customization file allows you to add custom HTML code, such as text, images, or links, to the DRC HTML report. The customization file uses HTML div tags to add a header and footer to the DRC HTML report. ");
MGCAddSnippet(253, "The example described here processes one DRC results database and includes DRCResultsSummary, DRCResults, and DRCHighlight report sections.");
MGCAddSnippet(254, "Some common problems in DRC HTML reporting are settings being ignored or no results in a report section.");
MGCAddSnippet(255, "You can convert results from an ASCII format Calibre results database (RDB) to error markers and route guides in your Place and Route tool. This allows you to use familiar tools when debugging errors and correcting the design. Calibre RDB Conversion is available for Synopsys IC Compiler and Cadence Encounter Digital Implementation (EDI). ");
MGCAddSnippet(256, "You can convert results from an ASCII format Calibre results database (RDB) to error markers and route guides in your Place and Route tool. Certain requirements for the design tool and Calibre results database must be met. ");
MGCAddSnippet(257, "You can convert results from an ASCII format Calibre results database (RDB) to Synopsys IC Compiler DRC error markers and route guides. This makes it easier to user the native Synopsys IC Compiler tools to debug errors and make design corrections. ");
MGCAddSnippet(258, "You can convert results from an ASCII format Calibre results database (RDB) to Synopsys IC Compiler DRC error markers. The conversion process automatically imports the error markers to the Synopsys IC Compiler session, where you can view them in the Error Browser. ");
MGCAddSnippet(259, "You can convert results from an ASCII format Calibre results database (RDB) to Synopsys IC Compiler route guides. The conversion process automatically imports the route guides to the Synopsys IC Compiler session. You can use Zroute with the new route guides to repair violations. ");
MGCAddSnippet(260, "You can convert results from an ASCII format Calibre results database (RDB) to Cadence Encounter DRC error markers and route blockages. This makes it easier to user the native Cadence Encounter tools to debug errors and make design corrections. ");
MGCAddSnippet(261, "You can convert results from an ASCII format Calibre results database (RDB) to Cadence Encounter DRC error markers. The conversion process automatically imports the error markers to the Cadence Encounter session, where you can view them in the Violation Browser. ");
MGCAddSnippet(262, "You can convert results from an ASCII format Calibre results database (RDB) to Cadence Encounter route blockages. The conversion process automatically imports the route blockages to the Cadence Encounter session. You can use NanoRoute in Cadence Encounter to repair violations. ");
MGCAddSnippet(263, "You can configure conversion options relating to cell, rule check, and side RDB inclusion when converting results in a Calibre RDB to native Place and Route formats. You can also specify options to control the offset, magnification, and minimum feature size of the converted shapes. ");
MGCAddSnippet(264, "You can control conversion options such as x- and y-offset, magnification, and minimum feature size when you convert results from an ASCII format Calibre results database (RDB) to a native Place and Route format. ");
MGCAddSnippet(265, "By default all results are included when you convert results from an ASCII format Calibre results database (RDB) to a native Place and Route format. You use the ‑cell option to convert only results from a specific cell. The cell must be the working design when doing the conversion within the Place and Route tool environment.");
MGCAddSnippet(266, "By default, results from side or auxiliary RDBs are not included when you convert results from an ASCII format Calibre results database (RDB) to a native Place and Route format. You use the  -side_rdb YES  option to include side RDB results. ");
MGCAddSnippet(267, "You can control which rule checks are included when you convert results from an ASCII format Calibre results database (RDB) to a native Place and Route format. By default results from all rule checks are converted. Use the ‑checks option to specify a list of rule checks—only results from the specified rule checks are converted. ");
MGCAddSnippet(268, "Several commands are available for converting results from an ASCII format Calibre results database (RDB) to native Place and Route tool formats. A check map file is required when converting to route guides or route blockages. ");
MGCAddSnippet(269, "Converts results from an ASCII format Calibre results database (RDB) to native Place and Route DRC error marker format. Used in the Synopsys IC Compiler or Cadence Encounter environment. ");
MGCAddSnippet(270, "Converts results from an ASCII format Calibre results database (RDB) to Synopsys IC Compiler route guides. The command is executed from the icc_shell prompt. ");
MGCAddSnippet(271, "Converts results from an ASCII format Calibre results database (RDB) to Cadence Encounter route blockages. The command is executed from the Cadence Encounter command prompt. ");
MGCAddSnippet(272, "The check map file is used when converting a Calibre results database (RDB) to native Place and Route formats. It associates check names in the RDB with layer names in the Place and Route environment. The check map file is required when converting to route guide or route blockage format. ");
MGCAddSnippet(273, "The Calibre RVE command includes options to convert results from an ASCII format Calibre results database (RDB) to native Place and Route tool formats. You execute the command in the Linux shell and save the converted output to file. The results can then be imported into your Place and Route tool. ");
MGCAddSnippet(274, "Imports a file saved from a previous Calibre RDB conversion to DRC error markers. Used in the Synopsys IC Compiler or Cadence Encounter environment.");
MGCAddSnippet(275, "Imports a file saved from a previous Calibre RDB conversion to Synopsys IC Compiler route guides. The cell containing the results you want to import must be the working design in your Synopsys IC Compiler session. The route guides can be viewed in the Synopsys IC Compiler session after the import. Used in the Synopsys IC Compiler environment.");
MGCAddSnippet(276, "Imports a file saved from a previous Calibre RDB conversion to Cadence Encounter route blockages. Used in the Cadence Encounter environment.");
MGCAddSnippet(277, "The Calibre RVE for DFM interface allows you to browse the contents of a DFM database. The DFM report card is integrated with Calibre RVE for DFM and enables you to browse errors by chip, by cell, and by window and to generate visual error representations in the form of color maps and histograms. ");
MGCAddSnippet(278, "This section provides an overview of the Calibre RVE for DFM functionality. It provides links to additional procedural sequences or usage descriptions in pertinent manuals.");
MGCAddSnippet(279, "The Calibre RVE for DFM interface appears when you invoke it from the command line, from Calibre Interactive, or from your layout viewer. You can view the results of your DFM run from this window. If you do not specify the DFM database on the command line, Calibre RVE prompts you for its pathname upon invocation. ");
MGCAddSnippet(280, "This section describes the Calibre RVE for DFM report card.");
MGCAddSnippet(281, "This section describes the menus items specific to the Calibre RVE for DFM application.");
MGCAddSnippet(282, "The menu items available from the View menu change based on which tab you currently have selected.");
MGCAddSnippet(283, "The Highlight menu in Calibre RVE for DFM has one DFM-specific selection, Highlight Net/Device/Pin.");
MGCAddSnippet(284, "The Macros menu is a special menu that allows you to run Tcl/Tk procedures and YieldServer commands directly from Calibre RVE. ");
MGCAddSnippet(285, "The Highlight Layout Net/Device/Pin dialog box highlights a net, device, or pin in the layout.");
MGCAddSnippet(286, "The Setup DFM Browser option pane controls settings for the DFM Browser in Calibre RVE.");
MGCAddSnippet(287, "You can set options for showing layers and properties on the DRC/DFM Highlighting Option pane. ");
MGCAddSnippet(288, "All tabs except the Layer Browser tab contain filtering controls that allow you to control how score data is displayed.");
MGCAddSnippet(289, "You can use the Layer Browser tab to examine errors on a layer-by-layer basis or to drill-down into a specific area on the selected layer. ");
MGCAddSnippet(290, "The Calibre DFM HTML report tool is a batch interface to the DFM database version of the DFM Report Card. ");
MGCAddSnippet(291, "Some licensing and input file requirements must be met to run DFM HTML Reporting. ");
MGCAddSnippet(292, "You create the DFM HTML report from the command line using  calibre -rve -dfm  with the appropriate options. ");
MGCAddSnippet(293, "The database map file (db_to_layout_map_file) is an input to DFM HTML reporting and specifies the DFM database directory as input for DFM HTML reporting. If result highlight images are included in the DFM HTML report, the layout database file and an optional Calibre DESIGNrev layer properties file are also specified in the file.");
MGCAddSnippet(294, "DFM HTML reporting is controlled by a configuration file containing the parameters that specify the reports and the output format.");
MGCAddSnippet(295, "The configuration file for DFM HTML reporting follows the generic INI file format. It contains key and value pairs specified (one per line) for each section. ");
MGCAddSnippet(296, "The Common section (specified as [Common]) is an optional section used to specify default values for key names not specified in other sections.");
MGCAddSnippet(297, "Each optional section in the configuration file has a type specified by the key name.");
MGCAddSnippet(298, "The following example shows a generic CAA configuration INI file.");
MGCAddSnippet(299, "DFM HTML reporting creates various files in the output directory. The format of the output files depends on the ReportType and OutputFormat keys in the configuration file. You can specify customization with the CSS file and the HTML customization file.");
MGCAddSnippet(300, "The output from the DFM HTML reporting tool is written to a directory specified from the command line. ");
MGCAddSnippet(301, "This section contains a list of the output formats supported by each ReportType.");
MGCAddSnippet(302, "DFM HTML reporting allows you to customize the format of the HTML report.");
MGCAddSnippet(303, "You can specify a CSS file to customize your DFM HTML report. The DFM HTML reporting tool generates a template CSS file if you do not specify a CSS file.");
MGCAddSnippet(304, "An HTML customization file allows you to insert custom code in the header and footer of the summary report, and the header of each section. ");
MGCAddSnippet(305, "The following examples show some common configuration setup files for generating HTML reports.");
MGCAddSnippet(306, "This example configuration file reports worst totals, worst rules, worst cells, and worst windows.");
MGCAddSnippet(307, "This example configuration file reports worst cells and worst rules.");
MGCAddSnippet(308, "This example configuration file reports worst windows and worst rules.");
MGCAddSnippet(309, "This example configuration file reports worst totals.");
MGCAddSnippet(310, "This example configuration file reports worst rules.");
MGCAddSnippet(311, "This example configuration file reports worst totals.");
