MGCAddSnippet(427, "This chapter describes how to use Calibre RVE (Results Viewing Environment) for LVS. Instructions for the tasks of isolating shorts, examining Calibre nmLVS comparison results, and using Design Fix Suggestions are included. Detailed information for the GUI elements is given in a reference section. ");
MGCAddSnippet(428, "The session window is arranged to provide convenient viewing of the Calibre nmLVS results and reports, highlighting of results in a connected layout viewer, and schematic browsing for comparison between layout and schematic. ");
MGCAddSnippet(429, "This section gives a run-through of key LVS tasks. These tasks introduce you to most of the important features of the LVS session.");
MGCAddSnippet(430, "Calibre RVE for LVS requires a standard verification database (SVDB). The SVDB is specified in the rule file and is created as part of your Calibre nmLVS run. Certain rule file statements and options are required in order to properly set up the results database. ");
MGCAddSnippet(431, "The results from the connectivity extraction component of the Calibre nmLVS run are shown in the Extraction Results tab. Extraction errors should be corrected first when debugging LVS errors, since they can lead to other errors. ");
MGCAddSnippet(432, "If your Calibre run creates a custom text or HTML-formatted report, you can create a link to the custom report in the Navigator Pane of Calibre RVE for LVS, PERC, or PEX. The link is shown in a section titled  User Files , and the custom report is opened in a web browser or a text tab within Calibre RVE. ");
MGCAddSnippet(433, "You can view Electrical Rule Check results in Calibre RVE for LVS. ");
MGCAddSnippet(434, "Cross-probing allows you to highlight the design elements involved in a LVS discrepancy or connectivity extraction error in the geometric layout, the source schematic, and the extracted layout schematic. Viewing the design element in both source and layout can help you determine the cause of the error.");
MGCAddSnippet(435, "There are several methods to help you debug shorts and other connectivity errors using Calibre RVE for LVS.");
MGCAddSnippet(436, "Shorts are often difficult to isolate in a design since they can have many different causes and may cross cell boundaries. Use this method to interactively isolate a short. After you isolate the short, you can use Calibre RVE for LVS to verify the short repair before you edit the design database.");
MGCAddSnippet(437, "The first step in interactive short isolation is to highlight the complete short in the layout viewer using a different highlight color for each layer.");
MGCAddSnippet(438, "You can use Calibre RVE for LVS to view the individual polygons that make up a short. ");
MGCAddSnippet(439, "When performing interactive short isolation, you may know that a particular polygon belongs to a certain net even though the polygon does not have a net label. You can use Calibre RVE for LVS to assign a net label to selected polygons. This can help you isolate the short, because the short is likely to be one of the polygons left without a net label.");
MGCAddSnippet(440, "A short is often caused by an unwanted metal or via polygon. You can virtually repair a short in Calibre RVE for LVS by marking polygons for removal. You can select polygons for removal using the Layout Shorts tab or select the polygons in a connected layout viewer. ");
MGCAddSnippet(441, "You can virtually repair a short in Calibre RVE for LVS by marking polygons for removal and assigning net labels to polygons. Then, still within Calibre RVE, you can run short verification to confirm that a short repair fixes the short and does not cause other shorts to appear. Once the short verification is successful, you make the actual change(s) in the layout database. ");
MGCAddSnippet(442, "You can save the polygons that are designated for removal during Interactive Short Isolation. The polygons are saved in an ASCII results database (RDB) file that can be opened at a later time in Calibre RVE and shared with other team members. You can use the RDB to highlight the polygons in the layout and fix the short. ");
MGCAddSnippet(443, "There may be times when you need to find a short between untexted layout nets. These types of shorts can be difficult to locate and the Isolate Path on Layout Net search on the Finder tab can assist with this task. Shorts between untexted nets can be reported by the LVS comparison stage, often just as a discrepancy stating that a layout net corresponds to two source nets. It is very helpful to include LVS Report Option FX in the Calibre run; this option reports shorts between untexted nets and provides a fix suggestion. ");
MGCAddSnippet(444, "You can use Calibre RVE for LVS to trace possible hierarchical shorts in the layout. The discrepancy types  Instances of cells with non-floating extra pins  and  Possible hierarchical short chains to non-floating extra pins  are relevant for this type of problem. In this context, a hierarchical short is an unwanted path between two nets at different levels of the layout hierarchy.");
MGCAddSnippet(445, "You can debug soft connection errors reported in an LVS Softchk database using features in Calibre RVE. The LVS Softchk database is displayed in a DRC-style report tab with many highlighting and cross-probing features from Calibre RVE for LVS available in menu and right-click selections. ");
MGCAddSnippet(446, "The topics in this section describe how to debug LVS Comparison results using Calibre RVE for LVS.");
MGCAddSnippet(447, "This section walks you through methods for examining LVS comparison errors in the Comparison Results tab of Calibre RVE. ");
MGCAddSnippet(448, "Design Fix Suggestions (if enabled) provide easy to understand suggestions for fixing certain types of errors. Many of the fix suggestions also have a Visualize Fix option that displays the fix suggestion in a schematic viewer window.");
MGCAddSnippet(449, "In some cases the Comparison Results tab in Calibre RVE for LVS displays only the top cell with a status of  Incorrect  or  Not compared  and the detailed view contains only text information with no links for highlighting and probing design elements. This can happen if Calibre encounters an error and halts processing before starting the LVS comparison phase. If processing stops without the Calibre nmLVS tool providing any comparison status or data, Calibre RVE reports  Comparison Not Performed  as the status. ");
MGCAddSnippet(450, "Calibre RVE for LVS reports the number of pins connected to the nets involved in a mismatched net discrepancy. Sorting by the number of connected pins can help you decide which discrepancy to fix first. ");
MGCAddSnippet(451, "This section provides detailed reference information for each of the elements in the Calibre RVE for LVS interface. ");
MGCAddSnippet(452, "The main session window in Calibre RVE for LVS includes a tree (hierarchical) and detailed view of results, toolbars for common actions and settings, and an optional Navigator pane. ");
MGCAddSnippet(453, "The LVS Runtime Errors and Warnings dialog box displays errors and warnings from the Calibre nmLVS run. The dialog box is displayed automatically at startup if  Show LVS/PERC runtime errors and warnings on startup  is enabled in the LVS/PERC/PEX category of the Options tab. ");
MGCAddSnippet(454, "This section describes the LVS-specific menu selections in Calibre RVE. ");
MGCAddSnippet(455, "The File menu does not include any items that are specific to a Calibre RVE for LVS session.");
MGCAddSnippet(456, "The View Menu includes some items that are specific to a Calibre RVE for LVS session. Some menu selections are only available when certain report tabs are selected, and this is noted in parentheses.");
MGCAddSnippet(457, "The Highlight menu has some selections that are specific to a Calibre RVE for LVS session.");
MGCAddSnippet(458, "The Tools menu has some selections that are specific to a Calibre RVE for LVS session.");
MGCAddSnippet(459, "The Setup menu has some selections that are specific to a Calibre RVE for LVS session. ");
MGCAddSnippet(460, "Toolbars provide shortcuts to commonly used menu selections. The standard toolbar is used for all Calibre RVE applications, while other toolbars are only available when the associated Report Tabs are selected. ");
MGCAddSnippet(461, "The buttons in the LVS toolbar control the highlighting color scheme, open the Highlights tab to set highlight colors and filters, and control how results are sorted for the Extraction and Comparison Results tabs. ");
MGCAddSnippet(462, "The short isolation toolbar is available when the Layout Shorts tab is selected. It allows you to quickly highlight the polygons that make up the path of the short.");
MGCAddSnippet(463, "This section provides reference material for the report tabs and detailed views in Calibre RVE for LVS.");
MGCAddSnippet(464, "The Extraction Results tab displays the results of netlist extraction. It provides a tree view and a detailed view of the results listed in the Extraction Report.");
MGCAddSnippet(465, "The Comparison Results tab presents the LVS comparison results. You can click design elements to highlight them, or right-click for a context-sensitive menu. ");
MGCAddSnippet(466, "Use the Layout Shorts tab for interactive short isolation. The tab provides a summary view and a detailed view of shorts in the design.");
MGCAddSnippet(467, "The ERC Results tab is available if you ran ERC checks in your Calibre nmLVS run. Open the ERC Results tab by clicking  ERC Results  in the Navigator, or choosing View > Results > ERC > ERC Database. ");
MGCAddSnippet(468, "The Fix Visualization View displays a schematic visualization of a Design Fix Suggestion. The visualization can help in fixing some LVS comparison errors.");
MGCAddSnippet(469, "Calibre RVE includes several tools and options that are shared by Calibre RVE for LVS, PERC, and PEX. These include search tools, highlighting options, and the Internal Schematic Viewer. ");
MGCAddSnippet(470, "Several session tools are available Calibre RVE for LVS, PEX, and PERC. The Navigator, Info Pane, Finder Tab, and Highlights tab make it easier to search for design elements, view design information, and set highlighting behavior. ");
MGCAddSnippet(471, "The Navigator Pane provides easy access to the information and controls in your Calibre RVE for LVS, PERC, or PEX session. ");
MGCAddSnippet(472, "The Info Pane displays detailed information about design elements and can perform searches for design elements in the layout. Searches also use the XDB binary cross-reference database, if present, to search for source names in the layout. The Info Pane is available in Calibre RVE for LVS, PERC, and PEX. ");
MGCAddSnippet(473, "The controls in the Finder tab allow you to search for design elements in the source or layout side of the design. You can specify options for narrowing the search to specific design elements, layers, or device types.");
MGCAddSnippet(474, "Use the  Particular Objects  search on the Finder tab to find design elements in either the source or the layout, using optional search filters. You can also enter a space separated list of objects to search for. ");
MGCAddSnippet(475, "Use  Objects at Location  search on the Finder tab to find objects at a specific location in the layout, using optional search filters.");
MGCAddSnippet(476, "The search type  Instances of Cell  on the Finder tab finds instances of a given layout cell. The search is made at the top level by default, but can be expanded to all levels. ");
MGCAddSnippet(477, "The search type  Unconnected Net Instances  on the Finder tab finds cell instances that have a target net unconnected to a reference net in a reference cell. The reference cell is specified in the  Search in which cell  field.");
MGCAddSnippet(478, "The  Find Path  search on the Finder tab finds paths in the layout or source between two or more nets. Nets may be excluded from the search. You can use a device filter in the Finder Filters to specify the devices and pins that make up the path if you do not want to use the default path definition.");
MGCAddSnippet(479, "The  Isolate Path on Layout Net  search on the Finder tab locates a path between two endpoints on a layout net. The endpoints must be on the same physical net. The returned path is not necessarily the shortest path. ");
MGCAddSnippet(480, "Search and selection filters are available for some types of search in the Finder tab. Layer, device, and window (region) filters are available. Where appropriate, the specified filters also apply when selecting items in an attached viewer to fill in a GUI field. In some cases the filters apply when expanding nodes in the search results. ");
MGCAddSnippet(481, "The Highlights tab in Calibre RVE specifies which layers and devices are highlighted in your layout viewer, assigns custom highlighting colors to layers, and specifies highlighting in only certain regions of the design. By default, all layers and devices are highlighted in the complete design. The Highlights tab is available in Calibre RVE for LVS, PERC, and PEX. ");
MGCAddSnippet(482, "The layer filter and color controls in the Highlights tab select colors for highlight layers (for supported viewers only) and select the layers that are displayed on highlight events.");
MGCAddSnippet(483, "When  Use Device Filter while highlighting  is enabled on the Highlights tab, only device types that are selected with a check mark in the device filter are highlighted. If no device type is selected in the filter or the setting is disabled, all device types are highlighted. The device filter is applied when highlighting devices on nets. ");
MGCAddSnippet(484, "The window filter on the Highlights tab limits highlighting to specified rectangular regions; use the right-click menu to control the window selections. ");
MGCAddSnippet(485, "You can specify a layer map file in Calibre RVE for LVS, PERC, and PEX in order to have the layer name/purpose pair displayed in Calibre RVE. This makes it easier to correlate the Calibre layers names to the layer names used in your layout viewer. You specify the layer map file on the Options tab, LVS/PERC/PEX category with the  Use Viewer Layer Map file  option. ");
MGCAddSnippet(486, "The Internal Schematic viewer provides schematic viewing for source and layout using schematic rendering technology. You enable and disable the Internal Schematic Viewer with View > Schematics and the  Show netlist schematics on highlighting  and  Show Schematic Pane  settings on the Options tab in the Schematic Viewer category. ");
MGCAddSnippet(487, "Calibre RVE for LVS uses schematic rendering technology to provide schematic viewing for both source and layout. Schematic comparison allows you to quickly see the cause of a LVS comparison error. The schematic window includes search capability and netlist display. The Internal Schematic Viewer obeys the case-sensitivity specified by the Layout Case and Source Case statements in the rule file.");
MGCAddSnippet(488, "The Internal Schematic Viewer toolbar has buttons for common options and actions.");
MGCAddSnippet(489, "The find bar in the Internal Schematic Viewer can search for nets, instances, devices, and text. ");
MGCAddSnippet(490, "There are various options for panning, zooming, highlighting, and expanding elements in the schematic view. ");
MGCAddSnippet(491, "Selecting an element in other tabs or windows of your LVS session automatically highlights the element in the netlist viewer and hierarchy tree.");
MGCAddSnippet(492, "This option pane controls settings for the Internal Schematic Viewer in Calibre RVE for LVS⁄PERC⁄PEX. ");
MGCAddSnippet(493, "You can view the hierarchical names for a net using the Internal Schematic Viewer or the Calibre RVE SPICE File Viewer. Viewing hierarchical names is especially useful if a net crosses cell or instance boundaries and changes names. ");
MGCAddSnippet(494, "You can select the pins that are displayed when you expand an instance. This is useful for instances with many pins so that you can focus on the pins of interest. When expanding an instance within the sub-hierarchy of a given instance, the filter dialog includes the name of the external net that is connected to the pin—this makes it easy to select pins to show based on the connected net. ");
MGCAddSnippet(495, "You can hide unconnected pins in cells and instances with more pins than a specified threshold value. The cell outline is shown as a dashed line if pins are hidden.");
MGCAddSnippet(496, "Symbol library (*.sym) files provide custom symbol shapes for the Internal Schematic Viewer and the Calibre RVE SPICE File Viewer. ");
MGCAddSnippet(497, "The following topics explain the use of the select environment in the Internal schematic viewer. ");
MGCAddSnippet(498, "You can extend the selection and highlighting of nets to include equivalent nets in a referenced subcircuit by defining a  select environment . Only one instance may be part of the extended select environment at a time. This feature can be used to trace pins from lower levels to upper level cells. ");
MGCAddSnippet(499, "You can save the select environment and have the selections restored when you open the same database in a later Calibre RVE session.");
MGCAddSnippet(500, "Calibre RVE includes several methods and options for highlighting and cross-probing design elements.");
MGCAddSnippet(501, "You can easily set the highlight color scheme from a dropdown list in the Calibre RVE toolbar. You can select a fixed highlight color, highlight each layer in a separate color, or cycle through a default or custom set of colors. ");
MGCAddSnippet(502, "You can display the net, device, instance, or port name as text attached to each highlight polygon. This is useful when highlighting multiple nets, because the net name is attached to each polygon on the net. This option is available in Calibre RVE for LVS, PERC, and PEX. ");
MGCAddSnippet(503, "Net-specific highlighting options are available from the context menu when you right-click a net. ");
MGCAddSnippet(504, "Context-sensitive right-click menus for design elements allow you to highlight the element in connected viewers and display other information about the design element. In most cases the function of the menu selection is clear; this section provides information that may not be obvious.");
MGCAddSnippet(505, "The right-click menu for nets includes selections to highlight devices, pins, and to highlight by layer. You can also emphasize a highlighted net. ");
MGCAddSnippet(506, "The Highlight in Lower Cell dialog box is displayed for certain LVS discrepancy types when the net has no shapes in the selected layout cell. ");
MGCAddSnippet(507, "Hierarchical Calibre applications internally create additional levels of hierarchy to support the hierarchical processing. These new internal cells are called  pseudocells , and named ICV_n, where n is an integer that is incremented. ");
MGCAddSnippet(508, "Depending on your design and verification process, the net name in the layout may be different than the net name in the netlist. For example, this can happen when top-level ports are named with the SVRF statement Port Layer Text. ");
MGCAddSnippet(509, "You can use the Particular Objects search in the Finder tab to select and highlight objects in an attached design tool. You can select multiple objects. ");
MGCAddSnippet(510, "There are two methods for highlighting the devices that are connected to a layout or source net.");
MGCAddSnippet(511, "By default, contact layers appearing in a Connect … BY statement are not included in highlighting actions in Calibre RVE for LVS, PERC, PEX, and DFM. There are two methods for including the contact layers.");
MGCAddSnippet(512, "If your Calibre flow produces a custom text report, you can open the report in Calibre RVE, then highlight design elements and view object information from the report. Selection-based highlighting is available from any text file open in a text tab. ");
MGCAddSnippet(513, "You can easily highlight from a property value that resolves to a net name. Calibre RVE attempts to match property values to net names in the layout. If a match is found, Calibre RVE adds appropriate right-click menu selections in the detailed view for the result. ");
MGCAddSnippet(514, "You can use the Info Pane to search for a list of objects in the layout. ");
MGCAddSnippet(515, "The Options tab in Calibre RVE includes highlighting options specific to Calibre RVE for LVS, PERC, and PEX. The Options tab also includes view options for the report tabs in these applications. ");
MGCAddSnippet(516, "This option pane controls settings for the results browsers in LVS, PERC, and PEX sessions. ");
MGCAddSnippet(517, "These options controls highlighting actions for the results browsers in LVS, PERC, and PEX sessions. ");
MGCAddSnippet(518, "Calibre RVE includes a SPICE file viewer that displays the netlist hierarchy, a rendered schematic view, and the netlist. ");
MGCAddSnippet(519, "Calibre RVE includes a SPICE file viewer which displays the netlist hierarchy, a rendered schematic view, and the netlist. The SPICE file may be a compressed file ending in the .gz or .Z file extensions. ");
MGCAddSnippet(520, "You can write a Tcl script for the Calibre RVE SPICE File Viewer. The Tcl script sets up a schematic view and saves the view to a file. ");
MGCAddSnippet(521, "Prior to printing schematic views with the Tcl scripting interface to the Calibre RVE SPICE File Viewer, you must set the viewer options. The viewer options are set within Calibre RVE and saved to the .rvedb file. The settings in the .rvedb file are used when the Tcl script is executed. ");
MGCAddSnippet(522, "The Calibre RVE SPICE file viewer includes a Tcl interface to output a schematic view to file. You can expand instances and highlight objects in the schematic view, then save the view to a postscript or Scalable Vector Graphics file.");
MGCAddSnippet(523, "You can create a Tcl script to create a schematic view with highlights and save the view to a postscript or SVG file. ");
MGCAddSnippet(524, "Tcl command that returns the list of netlists loaded in the Calibre RVE SPICE file viewer. ");
MGCAddSnippet(525, "Tcl command that returns the API object for a netlist that is loaded in the Calibre RVE SPICE file viewer. ");
MGCAddSnippet(526, "Tcl command to highlight a set of objects in the Calibre RVE SPICE file viewer. ");
MGCAddSnippet(527, "Tcl command to expand an instance in the Calibre RVE SPICE file viewer. ");
MGCAddSnippet(528, "Tcl command to output the schematic view to a file. ");
MGCAddSnippet(529, "This chapter describes how to use the Calibre Results Viewing Environment (RVE) for PEX. It covers the key features of the tool and a run-through of common tasks using the net parasitics table. A reference section describes each of the GUI elements.");
MGCAddSnippet(530, "The session window in Calibre RVE for PEX opens with report tabs for each report generated from your PEX run. Depending on your SVDB, you may see different reports. If parasitic extraction with multiple corners was performed, there is a Parasitics tab for each process corner. The View menu items and the report tabs are used to customize the display. ");
MGCAddSnippet(531, "The report tabs and toolbars in Calibre RVE for PEX provide the tools you need to analyze your parasitic extraction results.");
MGCAddSnippet(532, "You can view details, calculate point-to-point resistance, and export parasitic data using Calibre RVE for PEX. ");
MGCAddSnippet(533, "The net parasitics table is displayed in the Parasitics tab of Calibre RVE for PEX. The net parasitics table gives a summary of the parasitic information for each net, and provides controls to display detailed information. The key actions described in this section are:");
MGCAddSnippet(534, "Calibre RVE for PEX can save net parasitics data to a CSV (comma-separated value) formatted file; the file can then be imported into most spreadsheet tools for later analysis.");
MGCAddSnippet(535, "You can calculate point-to-point resistance and inductance between selected points on a net using Calibre RVE for PEX.");
MGCAddSnippet(536, "Calibre RVE for PEX can calculate point-to-point (P2P) resistance and inductance between selected points on a net. You can specify pins, ports, and coordinates as the end points. ");
MGCAddSnippet(537, "The parasitic extraction tool takes some extra steps when using a coordinate as one of the end points for calculating point-to-point resistance or inductance. If the specified coordinate does not coincide with the end point of an extracted resistor or inductor, the end point of the closest extracted element is used in the calculation. ");
MGCAddSnippet(538, "This section provides detailed reference information for each of the elements in Calibre RVE for PEX. ");
MGCAddSnippet(539, "The session window in Calibre RVE for PEX includes a net parasitics table and a Find Nets search toolbar. ");
MGCAddSnippet(540, "This section describes the PEX-specific menu selections. ");
MGCAddSnippet(541, "This section describes the contents of the File menu that are specific to Calibre RVE for PEX.");
MGCAddSnippet(542, "This section describes the contents of the View menu that are specific to Calibre RVE for PEX.");
MGCAddSnippet(543, "This sections describes the contents of the Highlight menu that are specific to Calibre RVE for PEX.");
MGCAddSnippet(544, "This section describes the contents of the Tools menu that are specific to Calibre RVE for PEX.");
MGCAddSnippet(545, "This section describes the contents of the Setup menu that are specific to Calibre RVE for PEX. ");
MGCAddSnippet(546, "The standard toolbar and the PEX toolbar are available in Calibre RVE for PEX. ");
MGCAddSnippet(547, "The parasitics toolbar is only available when the Parasitics tab is active.");
MGCAddSnippet(548, "The PEX Report tab includes the net parasitics table and control bars for finding nets and coupling capacitance. ");
MGCAddSnippet(549, "Use this report tab to the view the net parasitics table and access detailed information about selected nets. If parasitic extraction with multiple corners was performed, there is a Parasitics tab for each process corner. ");
MGCAddSnippet(550, "Use this control bar to search for nets in the parasitics table and to find the coupling capacitance to selected nets.");
MGCAddSnippet(551, "The detailed parasitics view shows information on the parasitic elements for a selected net.");
MGCAddSnippet(552, "By default, the actual node locations of a resistor are used when you highlight a resistor by clicking the  R  icon in the detailed parasitic view. You can set an environment variable to have Calibre RVE use the reduced node locations. ");
MGCAddSnippet(553, "Calibre RVE for PEX provides a variety of tools for making the task of investigating net parasitics easier. ");
MGCAddSnippet(554, "You can use Calibre RVE for PEX to select nets and create the victim file for mutual inductance. Choose Tools > Mutual Inductance to open the Mutual Inductance tab. ");
MGCAddSnippet(555, "Several option panes in Calibre RVE apply to the PEX interface. ");
MGCAddSnippet(556, "The Calibre Results Viewing Environment (RVE) for PERC provides a graphical interface for viewing and analyzing the results from Calibre PERC runs. You can highlighting results, sort and filter results, and view a rendered schematic. ");
MGCAddSnippet(557, "The session window in Calibre RVE for PERC displays a tree view of the results and details for each result. ");
MGCAddSnippet(558, "The format of the result database produced by a Calibre PERC run depends on the application that was run. A variety of techniques can be used in debugging the results.");
MGCAddSnippet(559, "You can start Calibre RVE from the command line or a design tool and view the results from a Calibre PERC run. ");
MGCAddSnippet(560, "This procedure gives common methods for examining the Standard Verification Database (SVDB) created by a Calibre PERC run. ");
MGCAddSnippet(561, "You can use several methods to highlight a result in Calibre RVE for PERC.");
MGCAddSnippet(562, "You can choose to view only one placement for each hierarchical result when loading a database in Calibre RVE for PERC. This can speed up the loading time for large databases. The option  Show only one placement for each hierarchical PERC result  on the Options tab in the LVS/PERC/PEX category must be enabled when you load the database.");
MGCAddSnippet(563, "A rule in Calibre PERC may produce more than one placement of a result, and each instance or placement of a result can be displayed in the Result View. The option  Show only one placement for each hierarchical PERC result  on the Options tab in the LVS/PERC/PEX category must be disabled when you load the database in order to view separate placements of a result.");
MGCAddSnippet(564, "You can waive topology results using Calibre RVE for PERC and create a topology waiver description file based on the waived results. You can specify trigger functions that run before or after the waiver file is created. ");
MGCAddSnippet(565, "You can use Calibre RVE for PERC to highlight the nets and pins listed in the output of a perc::trace command. ");
MGCAddSnippet(566, "The Calibre PERC Logic Driven Layout Current Density (LDL CD) and Point-to-Point (LDL P2P) applications produce a DFM Database and one or more DRC results databases in ASCII format. Calibre RVE for PERC allows you to view, sort, and filter results, highlight results to an attached layout viewer, and view a rendered schematic in the Internal Schematic Viewer. ");
MGCAddSnippet(567, "You can open the DFM database created by a Calibre PERC LDL run in Calibre RVE for PERC. The P2P or CD results databases (RDBs) are displayed in a DRC-format report tab. The following procedure describes how to open the DFM database and set options for highlighting results and nets.");
MGCAddSnippet(568, "You can highlight a result in an attached layout viewer, and view connectivity objects (nets, instances, devices, and pins) in the Internal Schematic Viewer. ");
MGCAddSnippet(569, "Calibre RVE has several features that allow you to sort, group, and filter results according to database properties. These features allow you to focus on a particular set of results as you debug a design. For example, you might attach a property named  Severity  to results, and use that property to group the tree hierarchy or filter the results in Calibre RVE. You can also create a histogram of a database property. ");
MGCAddSnippet(570, "You can add properties to a result during the Calibre PERC run with the ‑property switch for the perc::report_base_result command. Properties in the database can be used to group and sort results for easier analysis.");
MGCAddSnippet(571, "You can group results in the Tree View by cell name, check name, property value, and other selections. ");
MGCAddSnippet(572, "Result filters allow you to select a subset of your results to display in Calibre RVE. System-defined filters are available, or you can create and save a custom filter. ");
MGCAddSnippet(573, "Results filters are selected from a list of system-defined and user-defined result filters.");
MGCAddSnippet(574, "Custom result filters allow you to specify multiple conditions for a filter, such as check name, property value, waived state, and other conditions. Custom filters are saved and included in the filter list.");
MGCAddSnippet(575, "You can filter PERC results by user-defined categories. Filtering by categories makes it easier to select only the checks you are interested in debugging—only checks in the selected categories are displayed in the tree view of the Calibre RVE. A category is a grouping of rule checks and is defined in the Check Text Override (CTO) file. ");
MGCAddSnippet(576, "The Voltage Trace GUI in Calibre RVE for PERC displays a schematic view of the voltage propagation for a net. The Voltage Trace GUI makes use of data from the perc::create_voltage_path command. The Voltage Trace GUI is available for both Calibre PERC and Calibre PERC LDL results. ");
MGCAddSnippet(577, "Calibre RVE for PERC can generate a schematic view of the voltage propagation for a net. In single voltage mode, the GUI displays the trace for a selected voltage. ");
MGCAddSnippet(578, "You can trace a set of voltages using the Voltage Trace GUI in Calibre RVE for PERC. The Voltage Trace GUI displays the nets, pins, and devices that have a given voltage set—this can help when debugging voltage collisions, in which an unwanted voltage appears on a net. ");
MGCAddSnippet(579, "The Voltage Trace GUI relies on the presence of voltage data from the perc::create_voltage_path command in the Calibre PERC database. The end points of the voltage trace may be affected by the options to perc::create_voltage_path. The voltage tracing method differs depending on whether you use vectored or vectorless mode.");
MGCAddSnippet(580, "Calibre RVE for PERC can save results data to a CSV (comma-separated value) formatted file; the file can then be imported into most spreadsheet tools for later analysis. You can filter the data by applying a Calibre RVE result filter; only data that meets the applied filter is saved. In addition, you have the option of saving all displayed results, selected results, or property statistics. ");
MGCAddSnippet(581, "You can save a topological Calibre PERC results database in CSV (comma-separated value) format from the command line, without displaying the Calibre RVE interface. All results are saved to the CSV file. ");
MGCAddSnippet(582, "A histogram is a useful way to view the distribution of property values for a result. Histograms can only be created for numeric properties. ");
MGCAddSnippet(583, "If you have a custom text or HTML-formatted report, you can create a link to the custom report in the Calibre RVE for PERC display. ");
MGCAddSnippet(584, "This section provides detailed reference information for each of the elements in the Calibre RVE for PERC interface. ");
MGCAddSnippet(585, "The PERC Results tab is available if your Calibre PERC run produced a Mask SVDB Directory. ");
MGCAddSnippet(586, "The PERC Info Results tab displays Calibre PERC informational rule checks. The tab is present if the SELECTTYPE INFO keyword set is included in the PERC Load statement. ");
MGCAddSnippet(587, "The PERC Runtime Errors and Warnings dialog box displays errors and warnings from the Calibre PERC run. The dialog box is displayed automatically at startup if  Show LVS/PERC runtime errors and warnings on startup  is enabled in the LVS/PERC/PEX category of the Options tab. ");
MGCAddSnippet(588, "Each of the menu selections in Calibre RVE contains some PERC-specific menu selections. ");
MGCAddSnippet(589, "The File menu in Calibre RVE for PERC includes the Save Results As selection. ");
MGCAddSnippet(590, "The View menu in Calibre RVE for PERC includes selections for viewing reports, setting view options, and creating histograms and colormaps.");
MGCAddSnippet(591, "The Highlight menu in Calibre RVE for PERC includes items setting highlight options. Some menu selections are only available when viewing results from a Calibre PERC LDL run.");
MGCAddSnippet(592, "The Tools menu in Calibre RVE for PERC includes items related to managing waivers and for loading a Check Text Override (CTO) file. Some menu selections are only available when viewing results from a Calibre PERC LDL run.");
MGCAddSnippet(593, "The Setup menu in Calibre RVE for PERC includes the Password selection.");
MGCAddSnippet(594, "The toolbars in Calibre RVE for PERC provide shortcuts to commonly used menu selections. ");
MGCAddSnippet(595, "The selections available in the PERC toolbar depend on what type of report tab is selected.");
MGCAddSnippet(596, "The highlight toolbar includes the Highlight in Cell Context option and highlighting buttons. ");
MGCAddSnippet(597, "Bookmarks save the view options for the result tab so that you can easily return to a previous view for a debug session. A bookmark saves information such as the applied result filter, the Group By setting, the column selections, and more. ");
MGCAddSnippet(598, "The Bookmarks menu has selections to save a new bookmark and open a bookmarked view in Calibre RVE for DRC. Bookmarks save the view options for the result tab so that you can easily return to a previous view for a debug session. A bookmark saves information such as the applied result filter, the Group By setting, the column selections, and more. ");
MGCAddSnippet(599, "You use the Bookmarks menu to create and delete user bookmarks and change the bookmark name. Bookmarks save the view options for the result tab so that you can easily return to a previous view for a debug session.You can create bookmarks, delete them, and change the bookmark name. ");
MGCAddSnippet(600, "Creates a Calibre PERC waiver description file based on the waivers in the database. This option only applies to topology waivers.");
MGCAddSnippet(601, "The Extraction Results tab is available if your Calibre PERC run included layout netlist extraction. The tab is not opened if extraction results are clean. ");
MGCAddSnippet(602, "Calibre RVE for PERC provides a variety of tools for making the task of investigating Calibre PERC results easier. ");
MGCAddSnippet(603, "The options panes allow you to select behavior for result viewing and highlighting.");
MGCAddSnippet(604, "The ability to communicate with industry standard design tools is an important feature of Calibre Interactive and Calibre RVE. This chapter discusses how to use Calibre Interactive and Calibre RVE with some of the design tool integrations. It also explains the setup procedure for the design tools that require custom installation and discusses special operating considerations. ");
MGCAddSnippet(605, "Some interface concepts and actions are common to all integrated layout and schematic viewers, as explained in these sections:");
MGCAddSnippet(606, "You start Calibre RVE from an integrated layout viewer by choosing Start RVE from the Verification menu (Siemens viewers) or Calibre menu (other viewers). Calibre RVE can also be started from Calibre Interactive using the Start RVE button on the left panel of Calibre Interactive. ");
MGCAddSnippet(607, "The environment variable MGC_CALIBRE_RVE_NAME_DELIMITER is used to set the name delimiter used by Calibre RVE. This affects the highlight information Calibre RVE sends to a connected viewer. ");
MGCAddSnippet(608, "When Calibre nmDRC runs in dual database mode, it writes cells with names that end in  $D1$  and  $D2$  to the results output database. Because such cells probably do not exist in the input design, Calibre RVE strips those trailing four characters from cell names by default before sending them to the layout editor when highlighting results. You can change this behavior with an environment variable or an option setting in Calibre RVE for DRC. ");
MGCAddSnippet(609, "Calibre RVE uses certain default port numbers for socket communication with a connected layout or schematic viewer. The port numbers can also be set manually, as described here. Individual layout and schematic viewers may have additional methods for setting the port numbers; see the section for the specific viewer.");
MGCAddSnippet(610, "You can set the socket port manually through the Calibre RVE interface or by using an environment variable. By default, Calibre RVE uses socket port 9189 to communicate with the layout viewer. The tool automatically searches for an available socket if it cannot obtain the default socket. It initializes the first available socket between the numbers 5000 and 9999 and reports the socket number through a dialog box. ");
MGCAddSnippet(611, "You can set the socket port manually through the Calibre RVE interface or by using an environment variable. By default, Calibre RVE uses socket port 9199 to communicate with the schematic viewer. The tool automatically searches for an available socket if it cannot obtain the default socket. It initializes the first available socket between the numbers 5000 and 9999 and reports the socket number through a dialog box. ");
MGCAddSnippet(612, "Calibre DESIGNrev and Calibre WORKbench include a Verification menu for starting Calibre Interactive or Calibre RVE. ");
MGCAddSnippet(613, "By default, Calibre Interactive and Calibre RVE use socket port 9189 for communication. The tool automatically searches for an available socket if it cannot obtain the default socket. ");
MGCAddSnippet(614, "Choose VerificationStart RVE to start Calibre RVE from Calibre DESIGNrev or Calibre WORKbench.");
MGCAddSnippet(615, "Highlight options for Calibre DESIGNrev and Calibre WORKbench are on the Verification > RVE/CI Setup dialog box. You can set the base layer used for highlights, the number of highlight layers used, and the highlight line width. Multilayer highlighting is enabled by default; to specify single layer highlighting and have all highlights from Calibre RVE go to the same layer, set the Count to 1 in the RVE/CI Setup dialog box. ");
MGCAddSnippet(616, "You can set the text size used when highlighting with the Calibre RVE setting  Highlight Text Size . Choose Setup > Options, the Highlighting category, and expand the  Layout Highlighting  area to set this option. However, you must also enable some options in Calibre DESIGNrev.");
MGCAddSnippet(617, "Calibre DESIGNrev labels the highlight layer with the rule check name if you selected  Colors  in the Set Highlight Layers Dialog Box of Calibre RVE for DRC. This selection assigns a highlight layer color to each rule check and all errors from a given rule check are highlighted to the specified color.");
MGCAddSnippet(618, "When using the Calibre DESIGNrev layout viewer, you can specify the layers that are shown when you highlight a result from a DRC check. ");
MGCAddSnippet(619, "Calibre RVE for DRC can send result data as properties when highlighting a result in Calibre DESIGNrev.");
MGCAddSnippet(620, "There are several batch commands in Calibre DESIGNrev that are relevant when using Calibre RVE. There are commands to open an ASCII format results database (RDB), convert polygons to an RDB file, and move RDB error markers to a different level in the layout. ");
MGCAddSnippet(621, "Calibre RVE is integrated to the viewers Siemens Tanner S-Edit, a schematic viewer, and L-Edit, a layout design tool.");
MGCAddSnippet(622, "The IC Station product family changed its name to Pyxis with the v10.0 release of Pyxis, and this manual therefore refers to the Pyxis product. Pyxis has a Calibre pulldown menu with selections to open Calibre Interactive and Calibre RVE. ");
MGCAddSnippet(623, "By default, Calibre Interactive and Calibre RVE use socket port 9189 to communicate with Pyxis Layout. The tool automatically searches for an available socket if it cannot obtain the default socket. ");
MGCAddSnippet(624, "Choose Calibre > Start RVE in Pyxis Layout to start Calibre RVE. ");
MGCAddSnippet(625, "The following sections describe the Calibre interface to Cadence Virtuoso:");
MGCAddSnippet(626, "Calibre RVE supports Cadence Virtuoso versions 5.1, 6.1, 6.18, 12.1, 12.2, 12.3, and 18.1. ");
MGCAddSnippet(627, "The Calibre menu in Cadence Virtuoso layout and schematic windows (windows of type maskLayout or schematic by default) has the selections to start Calibre Interactive, start Calibre RVE, set up options, and map schematic nets.");
MGCAddSnippet(628, "The Calibre SKILL Interface uses a TCP socket to communicate with Calibre RVE and Calibre Interactive. When you load the calibre.skl file, the tool attempts to initialize a server socket at port 9189. If that port is being used, the tool searches for a free socket port in the range 5000 to 9999. ");
MGCAddSnippet(629, "Calibre RVE allows you to highlight various layout elements reported in Calibre results databases. Calibre RVE packages the highlight data in a file (Setup > Design Tools,  Highlight data file  setting) and sends a message to the SKILL Interface over the socket directing it to read the file. The SKILL Interface interprets the data from the file and performs the highlighting. ");
MGCAddSnippet(630, "The Setup RVE dialog box controls highlighting behavior for the Cadence Virtuoso integration, such as custom colors, layer visibility, libraries, and highlight layers. ");
MGCAddSnippet(631, "The Calibre RVE setting  Edit-in-place while highlighting  in the Setup RVE dialog box controls whether Calibre RVE highlights in the open window or opens a new window for each highlight. The Cadence Virtuoso setting for edit-in-place or descend edit has no effect on the highlighting behavior in Calibre RVE. ");
MGCAddSnippet(632, "If you have several libraries open, it is often useful to specify which library Calibre RVE should highlight results to. Calibre RVE maintains a list of libraries to determine which libraries to look in, and the search order.");
MGCAddSnippet(633, "You can define a map between the cells listed in the Calibre results database and a specific library/cell/view combination in the Cadence design tool. This feature is useful if cells have been copied to a different library or if the cell exists in multiple libraries. The cell map table enables Calibre RVE to highlight to the correct cell in the Cadence design tool. Choose HighlightSetup Cell Map to open the Map RVE Cells dialog box.");
MGCAddSnippet(634, "The Setup RVE dialog box (Calibre > Setup > RVE) allows you to choose which layers Calibre RVE uses to do highlighting. The default is layers y0 to y9. You can also choose the nine hilite layers, the warning marker layer, or the error marker layer. The MGC_RVE_HIGHLIGHT_LAYERS variable (either specified as an environment or SKILL variable), can also be used to choose from among any of these four choices of highlight layers. The valid values for MGC_RVE_HIGHLIGHT_LAYERS are y0, hilite, warning, and error.");
MGCAddSnippet(635, "You can also specify the layers that are shown when you highlight a result from a DRC check. Use the following rule check comment within a rule check in your rule file: ");
MGCAddSnippet(636, "In Calibre RVE for DRC, you can use the rule check text as a comment for a Cadence Virtuoso marker.");
MGCAddSnippet(637, "The Cadenced Virtuoso setting  Restore layer visibility upon exit from RVE  in the dialog box opened with Calibre > Setup > RVE controls whether changes you make to layer visibility during a Calibre RVE session are saved in Cadence Virtuoso when you exit Calibre RVE. ");
MGCAddSnippet(638, "Calibre RVE for DRC can send result data as properties when highlighting a result in Cadence Virtuoso. ");
MGCAddSnippet(639, "The Highlight > Clear Highlights menu item corresponds to the pencil eraser button on the toolbar. You can use different clicking sequences of this button to clear highlights for the selected window, all windows, or the cell in Cadence Virtuoso.");
MGCAddSnippet(640, "Several highlighting functions are available in the Calibre interface to Cadence Virtuoso. You can map these functions to keyboard shortcuts (or hotkeys).");
MGCAddSnippet(641, "You can use the same colors for highlighting in Cadence Virtuoso that are used for Calibre RVE histograms and colormaps. ");
MGCAddSnippet(642, "There are environment variables specific to Cadence Virtuoso for controlling case sensitivity in Calibre RVE. Calibre RVE also has methods for controlling case sensitivity.");
MGCAddSnippet(643, "Some common problems when highlighting to Cadence Virtuoso are not finding the correct library and cell and opening or not opening a new window. ");
MGCAddSnippet(644, "Several SKILL functions are available for Calibre RVE. ");
MGCAddSnippet(645, "Starts Calibre RVE from the SKILL command interpreter or a SKILL script.");
MGCAddSnippet(646, "SKILL function that opens the specified results database in a running Calibre RVE session if one exists. The results database may be a file or directory. If there is not a running Calibre RVE session, the database is opened in a new session. ");
MGCAddSnippet(647, "SKILL function that opens the specified ASCII format results database (RDB) in a running Calibre RVE session if one exists. If there is not a running Calibre RVE session, the RDB is opened in a new session. ");
MGCAddSnippet(648, "Specifies the first library that Calibre RVE searches in for cells to highlight to. When called without any arguments the current cell and view is used.");
MGCAddSnippet(649, "Saves the current set of visible layers as the default set of visible layers. ");
MGCAddSnippet(650, "You can specify the libraries Calibre RVE looks in for layout cells using a SKILL function. This function corresponds the  Libraries RVE should look in for  setting in the dialog box opened with Calibre > Setup > RVE in Cadence Virtuoso.");
MGCAddSnippet(651, "You can specify the libraries Calibre RVE looks in for schematic cells using a SKILL function. This functions corresponds the  Libraries RVE should look in for  setting in the dialog box opened with Calibre > Setup > RVE in Cadence Virtuoso.");
MGCAddSnippet(652, "Toggles the design layer visibility.");
MGCAddSnippet(653, "Calibre RVE for DRC can export waiver cells and shapes to a Cadence Virtuoso database. This is useful if you want to keep the waiver shapes in the native design database format rather than save the waiver shapes to a GDS or OASIS format database. ");
MGCAddSnippet(654, "In some cases Calibre Interactive or Calibre RVE is using [] as the bus name delimiter but the tool is interfacing with a Cadence schematic view that uses <> as the bus name delimiter. You can convert the bus name delimiter so that net selection and highlighting is handled correctly.");
MGCAddSnippet(655, "The Cadence Composer integration is similar to that for Cadence Virtuoso.");
MGCAddSnippet(656, "If you use Virtuoso CDL Out to export the source netlist file for use in a Calibre run, the netlist names may differ between the Cadence schematic and the netlist file seen by Calibre RVE. You can instruct Calibre RVE to use the name mapping information created by the Cadence netlisting process. This allows Calibre RVE to highlight the correct net in the Cadence Composer schematic view. This mode is enabled with the environment variable MGC_CALIBRE_ENABLE_ONM.");
MGCAddSnippet(657, "Calibre includes software that enables seamless integration of Calibre Interactive and Calibre RVE within the Cadence Encounter platform. A Calibre menu is activated when the supplied software is loaded into the Encounter environment, usually through the cal_enc.tcl file. ");
MGCAddSnippet(658, "The following script can be inserted into the enc.tcl file to load the Calibre software:");
MGCAddSnippet(659, "There are Cadence Encounter commands to open a results database in Calibre RVE. ");
MGCAddSnippet(660, "Opens a results database in a running Calibre RVE session if one exists. The results database may be a file or directory. If there is not a running Calibre RVE session, the RDB is opened in a new session. The command is entered at the Cadence Encounter command prompt.");
MGCAddSnippet(661, "Opens an ASCII format results database (RDB) in a running Calibre RVE session if one exists. If there is not a running Calibre RVE session, the RDB is opened in a new session. The command is entered at the Cadence Encounter command prompt.");
MGCAddSnippet(662, "You can control the appearance of the layers used for Calibre RVE highlights. ");
MGCAddSnippet(663, "Calibre Interactive and Calibre RVE are integrated with the CadenceInnovus Implementation System. The Calibre menu is added when the integration code is loaded. ");
MGCAddSnippet(664, "Integration code must be loaded to enable the Calibre integration to Cadence Innovus. The integration is supported for Calibre RVE and all Calibre Interactive applications except Calibre Interactive 3DSTACK. ");
MGCAddSnippet(665, "Calibre RVE is integrated to the Cadence QuickView Signoff Data Analysis Environment, allowing highlighting from Calibre RVE. There are some version compatibility restrictions. ");
MGCAddSnippet(666, "Calibre provides an integration of Calibre Interactive and Calibre RVE to Synopsys IC Compiler and Synopsys IC Compiler II. The integration makes it easy to run Calibre flows in the Synopsys IC Compiler environment and debug the results. ");
MGCAddSnippet(667, "The interactive flow with Calibre Interactive, Calibre RVE, and Synopsys IC Compiler allows you to easily run Calibre and debug results. The flow with Calibre nmDRC is illustrated.");
MGCAddSnippet(668, "The Calibre interface to Synopsys IC Compiler supports the Calibre nmDRC, Calibre nmLVS, Calibre PERC, PEX, and DFM applications for both Calibre Interactive and Calibre RVE. The Calibre menu is available after the interface is loaded. Synopsys IC Compiler II is also supported. ");
MGCAddSnippet(669, "The Calibre interface can be loaded automatically each time you start Synopsys IC Compiler, or you can manually install the interface. The Calibre—IC Compiler interface supports Synopsys IC Compiler versions through 2014.9. Synopsys IC Compiler II version M-2016.12-SP2 is supported. ");
MGCAddSnippet(670, "The Calibre interface can be loaded automatically each time you start Synopsys IC Compiler II, or you can manually install the interface. Synopsys IC Compiler II version M-2016.12-SP2 is supported. ");
MGCAddSnippet(671, "The README file for the Calibre -IC Compiler integration is at the following location:");
MGCAddSnippet(672, "The Calibre menu is available after Calibre interface is loaded. The menu has selections to start Calibre Interactive, Calibre RVE, and to selection setup options.");
MGCAddSnippet(673, "Synopsys IC Compiler is fully supported for all Calibre RVE applications: Calibre RVE for DRC, LVS, PEX, PERC, and DFM. Calibre RVE provides an easy to use GUI for analyzing Calibre results and allows you to highlight the results in an attached Synopsys IC Compiler design window.");
MGCAddSnippet(674, "The following procedure starts Calibre RVE and makes a socket connection to Synopsys IC Compiler. ");
MGCAddSnippet(675, "You can set the highlight color and layer visibility when using Calibre RVE with Synopsys IC Compiler. This can aid in debugging DRC results. In the IC Compiler II toolbar, select Calibre > Highlight Colors to open the Set Highlight Colors dialog box. You can change the highlight color, the fill pattern, and the line width of the border, as well as toggle the option to cycle colors while highlighting.");
MGCAddSnippet(676, "Commands are available to open results databases in Calibre RVE from the Synopsys IC Compiler and IC Compiler II command prompt. ");
MGCAddSnippet(677, "Opens the specified results database in a running Calibre RVE session, if one exists. The database may be a file or directory. If there is not a running Calibre RVE session, the results database is opened in a new session. The command is entered at the Synopsys IC Compiler or IC Compiler II command prompt.");
MGCAddSnippet(678, "Opens the specified ASCII results database (RDB) in a running Calibre RVE session, if one exists. If there is not a running Calibre RVE session, the RDB is opened in a new session. The command is entered in the Synopsys IC Compiler or IC Compiler II command prompt.");
MGCAddSnippet(679, "You can control layer visibility with the Restore Default Layers Toolbar or use functions available in Synopsys IC Compiler and IC Compiler II. ");
MGCAddSnippet(680, "Command in Synopsys IC Compiler and IC Compiler II that saves the current set of visible layers as the default set of visible layers.");
MGCAddSnippet(681, "Command in Synopsys IC Compiler and IC Compiler II that toggles the design layer visibility. ");
MGCAddSnippet(682, "Calibre Interactive and Calibre RVE communicate with Synopsys IC Compiler through a socket port. Socket communication is established automatically when you start Calibre Interactive or Calibre RVE from the Calibre menu in Synopsys IC Compiler. By default, Calibre Interactive and Calibre RVE use socket port 9189 for communication, and the tool automatically searches for an available socket if it cannot obtain the default socket.  Synopsys IC Compiler II is also supported.");
MGCAddSnippet(683, "The Silvaco Expert design tool includes integrations to Calibre Interactive nmDRC, Calibre Interactive nmLVS, Calibre RVE, and a custom interface to launch a batch Calibre nmDRC job. You can use these interfaces to launch a Calibre verification run from Silvaco Expert, then use Calibre RVE to highlight the errors in the open design. ");
MGCAddSnippet(684, "Silvaco Expert requires the MGC_HOME environment variable to be set and pointing to the location of the Calibre installation. It is good practice to also define CALIBRE_HOME in the same manner.");
MGCAddSnippet(685, "Calibre Interactive and Calibre RVE use certain default port numbers for socket communication with a connected design tool. By default, Calibre Interactive and Calibre RVE use socket port 9189 to communicate with a layout editor. The tool automatically searches for an available socket if it cannot obtain the default socket. When Silvaco Expert successfully opens a socket, it reports the socket number to the log file.");
MGCAddSnippet(686, "The Calibre menu in Silvaco Expert is at Verification > Calibre. ");
MGCAddSnippet(687, "Some viewer integrations are not discussed here because the integration is straightforward and does not require any special setup actions or custom commands for operation.");
MGCAddSnippet(688, "Calibre Interactive, Calibre RVE, and Calibre View generation read a number of environment variables that specify run-time behavior. Some environment variables apply to more than one application.");
MGCAddSnippet(689, "Several environment variables are available to control the behavior of Calibre RVE. ");
MGCAddSnippet(690, "Symbol Library (*.sym) files define custom shapes for symbols displayed by the Internal Schematic Viewer or SPICE File Viewer. ");
MGCAddSnippet(691, "The Symbol Library files provide custom shapes for symbols. The Symbol Library file is an ASCII file using the NlviewTM Symlib format from Concept Engineering. Calibre RVE uses the files to display custom symbol shapes in the Internal Schematic Viewer and SPICE File Viewer. ");
MGCAddSnippet(692, "The symbol shape elements are parameters in the symbol shape definition in the Symbol Library file. The shape elements include arc, text, path, port, and others elements that are used to define a custom symbol shape. The Symbol Library file is used by the Internal Schematic Viewer and SPICE File Viewer in Calibre RVE to display custom symbol shapes. ");
MGCAddSnippet(693, "The arc element defines a circle or an arc. Make the start and end points equal to define a circle. Note: fpath can also be used to define a circle. ");
MGCAddSnippet(694, "The attrdsp element defines an instance attribute and is used to display the cell or instance name at the specified location. ");
MGCAddSnippet(695, "The fpath element defines a closed path. The path is defined with x,y coordinate pairs; the start and end points must be the same. An arc may be defined by adding an  a  character as a suffix to the coordinates of an intermediate point in the path. The path definition is ended by a non-numerical entry, which may be the starting keyword of the next symbol element. ");
MGCAddSnippet(696, "The path element defines an open path. The path is defined with x,y coordinate pairs. The path definition is ended by a non-numerical entry, which may be the starting keyword of the next symbol element.");
MGCAddSnippet(697, "The permute element defines the allowed permutations for the ports in a symbol shape definition. ");
MGCAddSnippet(698, "The pinattrdsp element defines an instance-pin attribute. The pinattrdsp applies to the previous port definition. ");
MGCAddSnippet(699, "The place element supplies a placement hint for certain symbols. ");
MGCAddSnippet(700, "The port element defines a port name and location in the symbol shape. Port names in the symbol definition must match the port names in the netlist for the custom symbol shape to be applied. ");
MGCAddSnippet(701, "The text element defines a text label for the symbol. ");
MGCAddSnippet(702, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

